INSERT INTO `about` VALUES (1,'About NATA','no image','<div class=\"col-md-8 col-sm-12 about-content \">\n<h4>NATA is a new, non-profit cultural organization serving the Telugu community in the US and Canada.</h4>\n<p>It was announced on November 20, 2010 with its registered office in Princeton,New Jersey. NATA is established as service oriented organization due to its articles and mission. Created under the stewardship of prominent Telugu leaders, Drs. Prem Reddy, Pailla Malla Reddy, past presidents and past conveners of other Telugu organizations and prominent Telugu persons living in USA for long time. NATA is involved in promoting community services, cultural and social activities, student assistance, and preservation and promotion of Telugu language and heritage in the United States, and across the globe.</p>\n<p>NATA is more open and transparent in its structure and function. It was inaugurated on January 19th 2013 with 29 members Board of Directors and Executive committee under the leadership of President Mr. Sanjeev Reddy. Advisers, Members and Directors.prayer by Mr. Venkat Chennubhotla &amp; Mr.Phani Dokka</p>\n<p>The core mission of NATA is to serve the growing needs of thousands of people of Telugu origin living in North America. Membership is open to people of Telugu origin living across the globe. An estimated three hundred thousand Telugu people are living in the US and Canada, and a majority are professionals such as doctors, biomedical scientists, businessmen, engineers, information technologists, entrepreneurs, pharmacists, professors, teachers, real estate developers and highly skilled workers. NATA strives to serve them with cultural and social activities here in the US and back home in Andhra Pradesh,India.</p>\n<p>NATA&rsquo;s mission of serving the Telugu Indian-American community is achieved by organizing regional activities, meetings, and biannual conventions to celebrate Telugu culture and traditions. NATA has identified several key activities such as exchange programs for students, scientists, artists and professionals, and advancing the Telugu heritage, sponsoring events that enrich and enlighten society, and extending support back home for educational, business and overall development of Telugu communities across the globe.</p>\n<p>As part of its mission, NATA intends to promote the Telugu language to children of Telugu origin in the United States &ndash; so that they can read and write in Telugu as second language.</p>\n<p><a href=\"../../\" target=\"_blank\">www.nataus.org</a></p>\n</div>');
INSERT INTO `about_league` VALUES (1,'About Leauge','<p>New Jersey: North American Telugu Association (NATA) is creating history in USA by starting a NATA Youth Cricket League to help our younger generation play professional cricket. NATA has been successfully conducting regional and national youth cricket tournaments all over USA including New Jersey, California, Nevada and Michigan.<br /> Famous personalities Alvin Kallicharan (West Indies Ex-Captain), Ashok Patel (former Indian player), Earl Daley (former USA player) and Lalta Persaud (former Guyana Player) to name the few, graced NATA cricket tournaments in the past and motivated our young upcoming cricket stars.<br /> NATA Youth Cricket League is recognized by Atlantic Region, which part of USA Cricket Association (USACA), which is recognized by International Cricket Council (ICC). Performance of an individual player will be taken into account when Atlantic region board selects kids for USACA/ICC recognized youth cricket tournaments.<br /> This is big achievement for NATA members and supporters and great opportunity to our kids. NATA Youth Cricket League will be starting on May 16, 2015 and will go until August 29, 2015. <br />NATA Cricket Committee has worked with local townships, permit holders and secured 3 grounds (Amwell Valley Cricket Club-Hillsborough, Kilmer Field- Edison and Rowland Park-South Brunswick) in New Jersey, one ground in Philadelphia and 2 grounds in Washington DC area.\\r\\n\\r\\nNATA was the first Indian organization which conducted national cricket tournaments at the convention.<br /> NATA definitely brought a change to cricket world and set a new trend. NATA has unique strength that separates it from all other organizations. It has demonstrated through the leadership, vision, commitment and hard work. Thanks to our Grand sponsor Dr. Prem Reddy garu, our Advisory Council Chair for coming forward to support this league.\\r\\n\\r\\nNATA board has decided to work closely with cricket academies and conduct Youth Cricket League (U-14) -2015. NATA believes that our kids are no different than any other kid from cricket playing countries.<br /> All they need is a platform to showcase their talent. NATA\\\'s vision is to provide a sustainable platform for our next generation, build a strong bond with kids, bring more youth and strengthen our organization.\\r\\n\\r\\nA total of 6 teams from Atlantic region (CricMax Team A (NJ), CricMax Team B (NJ), Dream Cricket Warriors( NJ) , Indoor Cricket USA (NJ), StarSportsUS Knights (PA) and Washington Cricket League Youth (VA) will be participating the youth league.<br /> Each team will get a chance to play 10 preliminary round matches. A total of 33 matches are scheduled including Semifinals and Finals. CricHQ will be maintaining all the statistics online including team performances and individual player performances.<br /> These statistics will published on NATA, Atlantic Region, Dream Cricket and CricMax web sites.\\r\\n\\r\\nNATA Sports Committee headed by Nagesh Mukkamalla along with Raj Muniyappa and Mohammed Murtuza will work closely with Cricket Committee advisers Rajeshwar Reddy, Dr. Raghava Reddy Ghosala and Alla Rami Reddy, NATA BODs, RVPs, RCs, Web committee, social media committee, community services committee and members.<br /> Cricket is not just a sports, it is part of our culture and festivity. Please join us to encourage our young cricketers and let\\\'s celebrate our culture and cricket together.</p>','2015-06-18 12:28:21');
