INSERT INTO `event_detail` VALUES (246,'2015-10-10','09:09:00','<p>Dear NATA Leader,</p>\n<p>We are going to have our next NATA Board meeting on October 10th, 2015 at DFW Marriott, Irving, TX. Since our 2016 convention is in Dallas we will have convetion ceneter tour. Please make your travel arrangements accordingly.</p>\n<p>Below is the address &amp; link for hotel accomodations. We will send other details as soon as possible. Thanks to Dallas Team for working hard to get this done.</p>\n<p>See you in Dallas on October 9th.</p>\n<p>NATA Board Meeting at Dallas</p>\n<p>Start date: 10/9/15<br />End date: 10/11/15</p>\n<p><strong>Marriott hotel offering NATA special group rate:</strong></p>\n<p>Dallas/Fort Worth Airport Marriott for 89.00 USD per night</p>\n<p>Last day to book: 9/18/15</p>\n<p><a href=\"http://www.marriott.com/meeting-event-hotels/group-corporate-travel/groupCorp.mi?resLinkData=NATA%20Board%20Meeting%20at%20Dallas%5edfwap%60ntsntsa%6089.00%60USD%60false%601%6010/9/15%6010/11/15%609/18/15&amp;app=resvlink&amp;stop_mobi=yes\" target=\"_blank\">Book your group rate for NATA Board Meeting at Dallas</a></p>\n<p>Thanks,</p>\n<p>Girish Ramireddy<br />Secretary, NATA</p>','Next Board Meeting - October 10th, 2015 - Dallas, TX');
