INSERT INTO `event_detail` VALUES (248,'2015-10-03','09:09:00','<p>North American Telugu Association (NATA) Washington DC Metro team has organized a membership drive on October 3rd, 2015 at Banjara Indian Restaurant in Ashburn,VA.</p>\n<p>NATA DC Metro Membership organized by Board of Directors Babu Rao Samala, Sreenivasulu Reddy Somavarapu, RVP\'s Suresh Reddy kothinti, Sudharani Kondapu, Kiran Gunnam, Chair Mohan Kaladi, Co-Chair Sireesha Thatakula, Regional coordinators Srinath Palle, Satya, Jeevan, Anil, Suresh, Ninad, Sharath, Suren and Yashaswi Bodduluri with the support of President Dr.Mohan Mallam, President-Elect Rajeshwar Gangasani Reddy and Executive Vice President Dr. Raghava Reddy Gosala.</p>\n<p>The main event started with BoD Sreenivasulu Reddy Somavarapu welcoming around 250 members amid rousing claps of NATA family members. In just 2 weeks&rsquo; time NATA DC team able to made over 230 new memberships which is an historical Record.</p>\n<p>Two upcoming singers Kiran and Manasa Acharya who came all the way from India, They have entertained the crowd with latest hit songs.</p>\n<p>President-Elect Rajeshwar Reddy graced the occasion along with Executive President Dr.Raghava Reddy Gosala, BoD Treasurer Hari Velukur, Board of Director Anna Reddy, NJ RVP Dwarka Varanasi and DC Metro Team. President-Elect Rajeshwar Reddy has explained the activities that NATA been doing in USA including Cricket tournaments, Health Camps and community services back in India. He was so proud to see how NATA helping community when it needs and matters most. He was so thrilled to see so many new members and active supporters for NATA in this region.</p>\n<p>Executive president Dr. Raghava Reddy Gosala, in his welcoming speech praised the team&rsquo;s hard-work, dedication and delivery in short time. He enthralled to see the dream of young and enthusiastic members right in front of him. Dr. Reddy reiterated NATA is there for every Telugu family and thanked each individual for attending today\'s occasion.</p>\n<p>Web Committee Chair Mohan Kaladi mentioned that the DC Metro team is able to make historical number effortlessly just because of the NATA founders and the organization name in the community.</p>\n<p>Meeting ended with Vote of Thanks from Sreenivasulu Reddy Somavarapu who thanked all the BODs/RVPs/SCs/RCs/Chairs from DC Area for making it a phenomenal event. Thanks to our Grand Sponsor Dr. Prem Reddy Garu for supporting this event. NATA Washington DC &amp; Virginia team, expressed heart full gratitude and thanked all the members and volunteers who helped this event made grand success. Please</p>\n<p><a href=\"https://goo.gl/photos/ye49sTfAnez581vn8\" target=\"_blank\">https://goo.gl/photos/ye49sTfAnez581vn8</a></p>\n<p><a href=\"https://m.youtube.com/watch?feature=youtu.be&amp;v=wiiNe1ZO6WA\" target=\"_blank\">https://m.youtube.com/watch?feature=youtu.be&amp;v=wiiNe1ZO6WA</a></p>\n<p><a href=\"https://www.youtube.com/watch?v=9PK6rPT6Knk\" target=\"_blank\">https://www.youtube.com/watch?v=9PK6rPT6Knk</a></p>\n<p><a href=\"https://www.youtub','NATA Washington DC Metro Meet & Greet Event');
