INSERT INTO `event_detail` VALUES (269,'2015-11-14','09:09:00','<p>North Carolina: North American Telugu Association (NATA) North Carolina team has organized a membership drive on November 14th, 2015 at Sangam Indian Cuisine, Charlotte. The Membership drive was coordinated by RVP Raghurami Reddy Etukuru, Telugu Journal Standing Committee Chair Raghunatha Kotha, Regional Coordinators Radha Krishna Kaluvai, Sanjeeva Reddy Pappireddy, Raghu Ariga, Subba Reddy Meka, Ravi Gadireddy, Gopichand Reddy, Sreenivasulu Reddy Eduala, Rohan Gosala with the support of President Dr. Mohan Mallam, President-Elect Rajeshwar Gangasani Reddy and Executive Vice President Dr. Raghava Reddy Ghosala. The main event started with welcome speech by RVP Raghurami Reddy Etukuru and more than 100 members attended this event. The membership drive attracted 50 new members to the NATA family in addition to 70 members who joined since March 2015 totaling the new memberships from North Carolina to 120 this year alone. President-Elect Rajeshwar Reddy and Executive Vice President Dr. Raghava Reddy Ghosala addressed the members over the phone got special appreciation from the participants. President-Elect Rajeshwar Reddy has explained the activities that NATA been doing in USA including free Medical Camps, NATA Sevadays in India and upcoming Dallas Convention. Executive president Dr. Raghava Reddy Ghosala praised the team\'s hard-work, dedication and successfully adding more and more membership to NATA family in short time. Narasimha, a popular singer from the Telugu community entertained the crowd with melodious hit songs. NATA Team thanked all the NATA members for attending the event and made it a grand success.</p>\n<p><a href=\"https://photos.google.com/share/AF1QipOwM2oshxuVSwruAVCXOvLrmfQvFu2BOtIE_n8ynsTKI7_rbajYEOuInZpqlgtg8w?key=MlhwT2tLZ0NYaGFDZHJjN2hMU09nYkFQaHJtOTln\" target=\"_blank\">2015_NC_Membership Photos</a></p>','Charlotte Membership Drive');
