INSERT INTO `event_detail` VALUES (284,'2016-02-27','09:09:00','<table class=\"table table-bordered\">\n<tbody>\n<tr>\n<td>\n<h4>కథ: నిబంధనలు</h4>\n<ol type=\"a\">\n<li>కథ తెలుగు వారి జీవితలనికి అద్దం పట్టేలా ఉండాలి</li>\n<li>ప్రపంచంలోని ఏ ప్రాంతమైనా కథకు నేపధ్యం కావచ్చు. అయితే అది తెలుగువారి జీవితానికి సంబంధించినదై ఉండాలి</li>\n<li>కధలు అరటావు సైజులో 10 పేజీలకు మించకుండా ఒక వైపునే రాసి పంపాలి. దస్తూరి చక్కగా అర్థమయ్యేలా ఉండాలి. డి.టి.పి. చేసిన పక్షంలో అది 6 పేజీలకు మించరాదు</li>\n<li>కథను పంపేటప్పుడు రచయిత/రచయిత్రి పేరు అందులో ఉండరాదు. పేరు, పూర్తి చిరునామా వేరే కాగితం మీద రాసి జత పరచాలి. అనుకరణ, అనుసరణ కాదని, బ్లాగులోనూ, వెబ్ మాగజైనులోనూ రాలేదని హామీ పత్రం విధిగా జత చేయాలి. కవరు మీద &lsquo;నాటా-నవ్య వీక్లీ కథల పోటికి&rsquo; అని స్పష్టంగా పేర్కొనాలి.</li>\n<li>విదేశాల నుంచి కథలు పంపించే రచయితలు/రచయిత్రులు మాత్రమే ఈ-మెయిల్ <a href=\"navyaweekly@andhrajyothy.com\"> navyaweekly@andhrajyothy.com </a> సౌకర్యాన్ని ఉపయోగించుకోగలరు. స్వదేశీయులకు ఈ సౌకర్యం వర్తించదు.</li>\n<li>బహుమతి పొందిన కథలు &lsquo;నవ్య&rsquo; వీక్లీలోనే గాక నాటా వారి సావనీర్లో కూడా ప్రచురితమవుతాయి.</li>\n<li>పోటీ గడువు తేదిని పోడిగించేదుకు కానీ, అర్హమైన రచనలు రాకపోతే బహుమతుల్లో మార్పులు చేసేందుకు కాని &lsquo;నవ్య వీక్లీ&rsquo; యాజమాన్యానికి సర్వహక్కులూ ఉన్నాయి.</li>\n<li>కథల ఎంపిక విషయంలో తుది నిర్ణయం నవ్య సంపాదక వర్గానిదే! ఈ విషయంలో ఉత్తర ప్రత్యుత్తరాలకు కాని, వాద ప్రతివాదాలకు కాని తావు లేదు. ప్రచురణలు అనర్హమైన కథలను తిప్పి పంపడం సాద్యం కాదు</li>\n</ol>\n</td>\n<td>\n<h4>కవిత: నిబంధనలు</h4>\n<ol type=\"a\">\n<li>కవిత తెలుగు వారి జీవితానికి అద్దం పట్టేలా ఉండాలి.</li>\n<li>ప్రపంచంలోని ఏ ప్రాంతమైనా కవితకు నేపథ్యం కావచ్చు అయతే అది తెలుగు వారి జీవితానికి సంబంధించినదై ఉండాలి.</li>\n<li>కవిత 30 పంక్తులకు మించకుండా ఒకవైపునే రాసి పంపాలి. దస్తూరి చక్కగా అర్థమయ్యేలా ఉండాలి.</li>\n<li>కవితను పంపేటప్పుడు కవి/కవియత్రి పేరు అందులో ఉండరాదు. పేరు, పూర్తి చిరునామా వేరే కాగితం మీద రాసి జత పరచాలి. అనుకరణ కాదని, బ్లాగుల్లోనూ, వెబ్ మాగజైన్ లోనూ రాలేదని హమీ ప్రతం విధిగా జత చేయాలి. కవరు మీద \'నాటా-నవ్య వీక్లీ కవితల పోటీకీ అని స్పష్టంగా పేర్కొనాలి.</li>\n<li>విదేశాల నుంచి కవితలు పంపించే కవులు/కవయత్రులు మాత్రమే ఈ-మెయల్ <a href=\"navyaweekly@andhrajyothy.com\"> navyaweekly@andhrajyothy.com</a>&nbsp;సౌకర్యాన్ని ఉపయోగించుకోగలరు. స్వదేశీయులకు ఈ సౌకర్యం వర్తించదు.</li>\n<li>బహుమతి పొందిన కవితలు \'నవ్య \' వీక్లిలోనే గాక నాటా వారి సావనీర్ లో కూడా ప్రచురితమవుతాయి.</li>\n<li>పోటీ గడువు తేదీని పొడిగించేందుకు కానీ,అర్హమైన కవితలు రాకపోతే బహుమతుల్లో మార్పులు చేసేందుకు కానీ నవ్య వీక్లి యాజమాన్యానికి సర్వహక్కులూ ఉన్నాయి.</li>\n<li>కవితల ఎంపిక విషయంలో తుది నిర్ణయం నవ్య సంపాదక వర్గానిదే ! ఈ విషయంలో ఉత్తర ప్రత్యుత్తరాలకు కాని, వాద ప్రతివాదాలకు కాని తావు లేదు.ప్రచురణకు అనర్హమైన కవితలను తిప్పి పంపడం సాధ్యం కాదు.</li>\n</ol>\n</td>\n</tr>\n</tbody>\n</table>\n<p><a title=\"నాటా-నవ్య వీక్లీ కథలు - కవితల పోటి \" href=\"http://nataus.org/public/pdfs/Nata_Kathalapoti2016.pdf\" target=\"_blank\">నాటా-నవ్య వీక్లీ కథలు - కవితల పోటి </a></p>','నాటా-నవ్య వీక్లీ సంయుక్త నిర్వహణలో 10 కథలు : 10 కవితల పోటి ');
INSERT INTO `event_detail` VALUES (292,'2016-05-17','09:09:00','<div><strong>In its sixth year of existence just ahead of third bi-annual convention to be held in grandeur at Dallas (Texas), North American Telugu Association (NATA) organized national level music competitions, NATA Idol, across various US cities selecting few finalists from each city with a plan to conduct semi-finals and finals during convention.&nbsp;The winner of NATA Idol competition finals will be given an opportunity to sing in a Telugu movie which is a dream come true for many singing aspirants.&nbsp;</strong></div>\n<div>&nbsp;</div>\n<div><strong>The competitions held in Memphis, Tennessee on 05/13/2016 at The Great Hall and Conference center, Germantown &nbsp;were a huge success with several prominent personalities from various walks of life including local and national non-profit organizations attending. Celebrated Telugu film industry personalities Chandrabose and Raghu Kunche comprised expert panel of judges scrutinizing the performers for the competitions. The winner will be given an opportunity to sing in a Telugu movie to be directed by Raghu Kunche. The competitions saw flow of talented singers between ages 12 and 55 who put in best effort to present their talent. Judges Chandrabose and Raghu Kunche provided their valuable feedback and suggestions to participants. The scoring was based on sangeetham, bhaavam, selection and presentation of song with clarity and melody. The program was well anchored by TV5 anchor Hasini, Kiran Parupudi &amp; Aparna Bhatla who added a dash of humor with their style. NATA Congratulates Memphis NATA Idol winners Shobana Krupasagar &amp; Mahesh Pillai who will be heading for finals in Dallas.</strong></div>\n<div>&nbsp;<img class=\"CToWUd a6T\" tabindex=\"0\" src=\"https://ci4.googleusercontent.com/proxy/4OOqX5E6ysKxCVeqFOBm9vtSDdbK4BiLfGLtYJwNaTm8cTswI6XIeqM0DFlCTzEbYNivTXq008-nPfsPbPUdJ3LvWG8tTZED_M7j5HeabIHie5F3QOkHadD6MFwFrIcTJdy7=s0-d-e1-ft#http://files.ctctcdn.com/99af74a7201/0fec1ec1-1e96-4c69-8fe1-7bb2b8d68c1b.jpg\" alt=\"\" width=\"607\" name=\"m_-6476626524618094155_m_-7442960194653603319_m_-7892984596109869019_ACCOUNT.IMAGE.594\" border=\"0\" hspace=\"5\" vspace=\"5\" /></div>\n<div>&nbsp;</div>\n<div><strong>NATA Idol National committee chair Girish RamiReddy and team members Neelima Gaddamanugu,&nbsp;Rekha Karanam, Santha Susarla, &nbsp;Sirisha Thatakula,Madhavi Sunki Reddy,&nbsp;Ram Cheruvu, Dwarak Varanasi,&nbsp;Darga Nagi Reddy,&nbsp;Dr.Dwarakanth Reddy put in paramount effort to formulate and design a program that would select talent across USA by organizing NATA Idol programs in many cities. Girish Ramireddy and Santa Susarla had made huge effort traveling to every city along with judges and others providing support to the local teams in conducting competitions smoothly.&nbsp;</strong></div>\n<div><strong>&nbsp;</strong></div>\n<div>&nbsp;<img class=\"CToWUd a6T\" tabindex=\"0\" src=\"https://ci3.googleusercontent.com/proxy/Rma34tYiZZ537UfFnoGpw3BoEutStRAAtv2c9WYQh2PYxafY3kEDM75ZKE6wBHXLxKJhG5W1Mi2-gd3_HM-wbi9IMb8jxOla9Cm7XtXv7AHPcEcqrdGT9htRDXlHzLXITuuu=s0-d-e1-ft#http://files.ctctcdn.com/99af74a7201/14725655-4619-43c7-b245-8f96d05c5bc0.jpg\" alt=\"\" width=\"607\" name=\"m_-6476626524618094155_m_-7442960194653603319_m_-7892984596109869019_ACCOUNT.IMAGE.595\" border=\"0\" hspace=\"5\" vspace=\"5\" /></div>\n<div><strong>Regional Vice President Janardhan Reddy Boyella, Kiran Parupudi, Aparna Bhatla , Jay Bhatla, Regional Coordinator Sampath Giledi, Murali Manikonda, Dinesh Bollimuntha, Raj Thota &amp; Naveen Mamidipalli are the key local team who made sure Memphis program was held with a bang supported by other local members TAM Chairman Veerabhadram Narisetty, Samson George, Subhashini Kota, Ramanthan Subbarayan , Vijay Kalaga, Venkat Chintamaneni, Harish Butti, Lakshmi Teja Boyella, Manju Manikonda, Kiranmai Giledi &amp; Sudhakar Borra had been instrumental in putting major effort pulling Memphis event together right from venue to food to musical instruments and arrangements which was appreciated by contestants and guests equally.</strong></div>\n<div><strong>&nbsp;</strong></div>\n<div><strong>A total of 19 contestants participated in the competition. Venkat Chintamaneni helped with publicity, registrations.&nbsp; Murali Manikonda, Dinesh Bollimuntha, Raj Thota helped with photography and Videography along with TV5 Cameraman Sundar. Chief guest for this program was NATA Secretary, NATA Idol Chair Mr. Girish Ramireddy.</strong></div>\n<div>&nbsp;</div>\n<div><strong>Kiran Parupudi welcomed the guests with his opening note and Aparna Bhatla and Lakshmi Chodavarapu song a prarthana geetham and then there were variety of songs that were sung in the first half by the contestants. There was a break after 10 contestants and two local dance performances were well received by the audience. These two dances were choreographed by Uma Belde and Aparna Bhatla. NATA Chair Mr. Girish Ramireddy talked about the NATA projects and Regional Vice President Mr. Janardhan Reddy Boyella told the community about the NATA charity projects and asked the members to kindly spread the word and also the importance of NATA membership benefits. The program started again and audience were glued to their seats till&nbsp;<span class=\"aBn\" tabindex=\"0\" data-term=\"goog_933448166\"><span class=\"aQJ\">10.45 PM</span></span>&nbsp;and it was an absolute musical bliss to the spectators.</strong></div>\n<div>&nbsp;</div>\n<div><strong>As always, ancillary support was provided by Dr.Prem reddy as the grand sponsor for the event supported by NATA Advisors president Dr.Mohan Mallam, President Elect Rajeswar Reddy Gangasani, EVP Dr Raghava Reddy Gosala, Treasurer Hari Velkur, ED Rami A Reddy, Convener Dr.Ramana Reddy &amp; Coordinator Ramasurya Reddy.&nbsp;</strong></div>\n<div>&nbsp;</div>','NATA IDOL MEMPHIS GRAND SUCCESS');
INSERT INTO `event_detail` VALUES (293,'2016-05-17','09:09:00','<div>In its sixth year of existence just ahead of third bi-annual convention to be held in grandeur at Dallas (Texas), North American Telugu Association (NATA) organized national level music competitions, NATA Idol, across various US cities selecting few finalists from each city with a plan to conduct semi-finals and finals during convention.&nbsp;The winner of NATA Idol competition finals will be given an opportunity to sing in a Telugu movie which is a dream come true for many singing aspirants.&nbsp;</div>\n<div>\n<div><img class=\"CToWUd a6T\" tabindex=\"0\" src=\"https://ci5.googleusercontent.com/proxy/O4viD5W20PlMwfFx0gb4OmEwJ_ZCxFA5_yoZC_OP_RjoEn45_xr-L4vChz9uYWRTfEmFeRgbHl3xHoTj3VwpeKfTlyG1yobXbLc5pu_eCicJMyC-8Hr8VQbPWzsgHBXYxkb7=s0-d-e1-ft#http://files.ctctcdn.com/99af74a7201/1b154128-b394-4079-a5d0-941b4a49914c.jpg\" alt=\"\" width=\"607\" name=\"m_-2661872176225492073_m_-128558625913290321_ACCOUNT.IMAGE.592\" border=\"0\" hspace=\"5\" vspace=\"5\" /></div>\n<div>The competitions held in Atlanta on 05/14/2016 at Sky Land Business&nbsp;Center&nbsp;were a huge success with several prominent personalities from various walks of life including local and national non-profit organizations attending. Celebrated Telugu film industry personalities Chandrabose and Raghu Kunche comprised expert panel of judges scrutinizing the performers for the competitions. The winner will be given an opportunity to sing in a Telugu movie to be directed by Raghu Kunche. The competitions saw flow of talented singers between ages 12 and 55 who put in best effort to present their talent. Judges Chandrabose and Raghu Kunche provided their valuable feedback and suggestions to participants. The scoring was based on sangeetham, bhaavam, selection and presentation of song with clarity and melody. The program was well anchored by TV5 anchor Hasini who added a dash of humor with her style. NATA Congratulates Atlanta NATA Idol winners who will be heading for finals in Dallas.</div>\n<div>&nbsp;</div>\n<div><img class=\"CToWUd a6T\" tabindex=\"0\" src=\"https://ci3.googleusercontent.com/proxy/tqxawUIQVK08aCpcFBic8jfgLiR77vQ2VEtkbmzYTzOqnSXMaygUQ8P1YfJs5hW_exvDG8rKdVHUK_3mvuhoRy6Sc-UctXU0utBdFQ_LTMER5nmwzEgds7Eq0Cioeb9l23K8=s0-d-e1-ft#http://files.ctctcdn.com/99af74a7201/63ac2d70-b234-45cd-b4b7-72d45bb4921a.jpg\" alt=\"\" width=\"607\" name=\"m_-2661872176225492073_m_-128558625913290321_ACCOUNT.IMAGE.593\" border=\"0\" hspace=\"5\" vspace=\"5\" /></div>\n<div>NATA Idol National committee chair Girish RamiReddy and team membersNeelima Gaddamanugu,&nbsp;Rekha Karanam, Santha Susarla, &nbsp;Sirisha Thatakula,Madhavi Sunki Reddy,&nbsp;Ram Cheruvu, Dwarak Varanasi, Darga Nagi Reddy,&nbsp;Dr.Dwarakanth Reddy put in paramount effort to formulate and design a program that would select talent across USA by organizing NATA Idol programs in many cities. Girish Ramireddy and Santa Susarla had made huge effort traveling to every city along with judges and others providing support to the local teams in conducting competitions smoothly.&nbsp;</div>\n<div>&nbsp;</div>\n<div>NATA 2014 convener Bala Indurti, Board Of Directors Srini Vangimalla &amp; Ravi Kandimalla, RVP\'s Kiran Kandula &amp; Venkat Mondeddu, National standing committee chair Neelima Gaddamanugu are the key local team who made sure Atlanta program was held with a bang supported by other NATA team members such as BOD Srinivas Kotlure, RVP Gopinath Reddy, National Standing Committee chairs Ramesh Chaparala, Madhavi Indurti, Jagadeeshwar Reddy Cheemarla &amp; Guru Paradarami, Regional Coordinators Bindu Jonnalagadda &amp; Ramesh Kotike. RVP Kiran Kandula &amp; Neelima Gaddmanugu had been instrumental in putting major effort pulling Atlanta event together right from venue to food arrangements which was appreciated by contestants and guests equally. RVP Venkat Mondeddu helped with publicity, registrations &amp; negotiating plaque discounts. Ram Durvasula, Venkat Chennubhotla, Swathi Kari, Shanti Medicharla and Bhanu Sri provided support during execution stage of the program. Katyayani Kosaraju, Bindu &amp; Madhavi helped with stage decorations.</div>\n<div>&nbsp;</div>\n<div>NATA BOD Srini Vangimalla welcomed the guests with his opening note and invited NATA team on to stage while BOD Ravi Kandimalla gave a synopsis of NATA social initiatives held in India as Seva Days coordinator. Girish Rami Reddy &amp; Neelima Gaddamanugu explained the birth of NATA Idol concept and background. NATA appreciates its sponsors for the event Printvise (National), Bawarchi Biryani Point, Krishna Training, Venkat Gaddam of Dream Realty Group. Other credits include&nbsp;Rami Reddy Jana of Golden Line for discounts related to plaques nationwide, Joji for sound system,&nbsp;John Gladson for photography, Sundar for TV5 camerawork, Divinity AV for Audio &amp; Media partners TV5, ManaTV. The program was relayed live on MANA TV as&nbsp;\"TV5 NATA IDOL\".</div>\n<div>&nbsp;</div>\n<div>As always, ancillary support was provided by Dr.Prem reddy as the grand sponsor for the event supported by NATA Advisors president Dr.Mohan Mallam, President Elect Rajeswar Reddy Gangasani, EVP Dr Raghava Reddy Gosala, Treasurer Hari Velkur, ED Rami A Reddy, Convener Dr.Ramana Reddy &amp; Coordinator Ramasurya Reddy.&nbsp;</div>\n<div>&nbsp;</div>\n<div><a href=\"../../gallery/view_gal_trail/26\" target=\"_blank\">For Explore All Pictures of&nbsp;NATA IDOL ATLANTA</a></div>\n</div>','NATA IDOL ATLANTA GRAND SUCCESS');
INSERT INTO `event_detail` VALUES (294,'2016-05-17','09:09:00','<div>Just ahead of its third bi-annual convention to be held in Dallas (Texas), North American Telugu Association (NATA) organized singing competition, NATA Idol, in Charlotte, North Carolina on 15 May 2016. This event is part of series of NATA Idols being conducted across 10 cities in USA. Finalists of each city will be participated in semi finals, which will be held at NATA convention, 2016. The final winner of finals will get a chance to sing in Telugu movie. Famous Lyricist Chandra Bose and Singer/Music Director Raghu Kunche were the judges for this NATA IDOL program.&nbsp;</div>\n<div><img class=\"CToWUd a6T\" tabindex=\"0\" src=\"https://ci6.googleusercontent.com/proxy/gyrelO-LCS4a3YHtWXrPO-_7Qgz_AG8jhUGGBeYQ7mPavBqo_zU6Iwv46YHweKMOVuIrqmSjDvqdHkVwWcAdqu0oW2Rvx06qWWLRn4gHIW34iupUIetnPxsdD88hvwRxIFJx=s0-d-e1-ft#http://files.ctctcdn.com/99af74a7201/09838191-f70b-43ee-95d5-3a6949f22c90.jpg\" alt=\"\" width=\"607\" name=\"m_-3306930424076316529_m_-6097839415867187760_ACCOUNT.IMAGE.597\" border=\"0\" hspace=\"5\" vspace=\"5\" /></div>\n<div>Yamini Pandrapagada, Swapna Jandhyala, Sukumar Atla, Srian Pedibhotla, Soumya Sistla, Sireesha Thota, Shyam Pedibhotla, Shriya Komaragiri, Sarayu Adala, Narasimha Medikayala, Gayathri Srinivasa, Vaishnavi Vadlamani, Srinivasu Vadlamani, Soumya Vadlamudi, Smitha Anchoori, Pallavi Tumuluru, Maina Edula, Keerthana Yathavakilla,&nbsp;Archana Patel, Aravind Mokkarala, Aara Krishna took part in this competition and hall was resounded with claps and whistles for their performances.</div>\n<div><img class=\"CToWUd a6T\" tabindex=\"0\" src=\"https://ci4.googleusercontent.com/proxy/8u6fVYOkktkyo-S4qz_QIoe4aCpFC_k2zE_Fz12O-RwgCRngEJyNc8mUoWbktly_BJE82_8CcgqkXRCw2gMB5RyBJMKnEkTs3kDJL6dtVdtbu9OTsIDCJThss-oZ-Wao7ZeE=s0-d-e1-ft#http://files.ctctcdn.com/99af74a7201/0b82dd69-f435-491e-9d16-1a3702ebe4e4.jpg\" alt=\"\" width=\"607\" name=\"m_-3306930424076316529_m_-6097839415867187760_ACCOUNT.IMAGE.596\" border=\"0\" hspace=\"5\" vspace=\"5\" /></div>\n<div>Dr. Prem Reddy is the Grand National sponsor for this event and &nbsp;Raghurami Reddy Etukuru is the grand local sponsor.</div>\n<div>&nbsp;</div>\n<div>The event was organized under the leadership of Raghurami Reddy Etukuru, Regional Vice President of NATA. The team included Raghunatha Reddy Kotha, Subba Reddy Meka, Srinivas Doki, Sanjeeva Reddy Pappireddy, Radhakrishna Reddy Kaluvai, Ram Manchi, Satya Kadali, Raghu Ariga, and Ravi Gadireddy. More than 300 people were attended the event. Tasty dinner and tea were provided to the attendees.&nbsp;</div>\n<div>&nbsp;</div>\n<div>NATA Secretary Girish Ramireddy was a chief guest to the event who travelled from Houston to attend the event. Semifinals and Finals will be held in convention center in Dallas on <span class=\"aBn\" tabindex=\"0\" data-term=\"goog_933448167\"><span class=\"aQJ\">28th and 29th May 2016</span></span>.</div>\n<p><a href=\"../../gallery/view_gal_trail/28\" target=\"_blank\">For Explore All Pictures of&nbsp;NATA IDOL CHARLOTTE</a></p>','NATA IDOL CHARLOTTE GRAND SUCCESS');
