INSERT INTO `news` VALUES (69,'Nata Seva Days links','<p>&nbsp;Telugus living in USA for six decades going strong Telugus living in USA for six decades going strong City to have Entrepreneurs Association chapter Networking is better than not working Telugus living in USA</p>\n<div id=\"main\">\n<div class=\"post-heading\">\n<h1>Nata Seva Days links</h1>\n</div>\n<div class=\"post-entry\">\n<p><a href=\"http://www.apnnews.com/2013/12/27/telugus-living-in-usa-for-six-decades-going-strong/\" target=\"_blank\">Telugus living in USA for six decades going strong</a></p>\n<p><a href=\"http://nripress.com/2013/12/27/telugus-living-usa-six-decades-going-strong/\" target=\"_blank\">Telugus living in USA for six decades going strong</a></p>\n<p><a href=\"http://metroindia.com/Details.aspx?id=16125\" target=\"_blank\">City to have Entrepreneurs Association chapter</a></p>\n<p><a href=\"http://www.apnnews.com/2013/12/27/networking-is-better-than-not-working/\" target=\"_blank\">Networking is better than not working</a></p>\n<p><a href=\"http://www.telugupeople.com/news/article_00086085_Telugus_living_in_USA_for_six_decades_going_strong.asp\" target=\"_blank\">Telugus living in USA for six decades going strong</a></p>\n<p><a href=\"http://www.thehindu.com/todays-paper/tp-national/tp-andhrapradesh/nata-spends-rs-2-cr-on-state-projects/article5510841.ece\" target=\"_blank\">NATA spends Rs. 2 cr. on State projects</a></p>\n<p><a href=\"http://news.webindia123.com/news/Articles/India/20131227/2310186.html\" target=\"_blank\">Telugus contribute to growth of US economy: NATA Prez</a></p>\n<p><a href=\"http://www.thehansindia.com/posts/index/2013-12-28/NATA%E2%80%99s-%E2%80%98walk-for-girl-child%E2%80%99-tomorrow-80640\" target=\"_blank\">NATA&rsquo;s &lsquo;walk for girl child&rsquo; tomorrow</a></p>\n<p><a href=\"http://metroindia.com/Details.aspx?id=16182\" target=\"_blank\">NATA to conduct walk, kavi sammelanam in city</a></p>\n<p><a href=\"http://articles.timesofindia.indiatimes.co