INSERT INTO `news` VALUES (70,'న్యూ జెర్సీ లో నాటా సమావేశం విజయవంతం','<p>నాటా ప్రెసిడెంట్ సంజీవ రెడ్డి న్యూ జెర్సీ విచ్చేసిన సందర్భాన్ని పురస్కరించుకొని ఈశాన్య అమెరికా లో ఉంటున్న నార్త్ అమెరికన్ తెలుగు అసోసియేషన్ (నాటా) నాయకులు ఈ రోజు మిర్చి రెస్టారెంట్ లో కలుసుకొన్నారు. నాటా సలహా మండలి సభ్యులు డాక్టర్ పైళ్ల మల్లా రెడ్డి కూడా హాజరయిన ఈ సమావేశాన్ని నాటా బోర్డు సభ్యుడు రాజేశ్వర్ రెడ్డి నిర్వహించారు. ఈ సమావేశానికి 250 కి పైగా నాటా సభ్యులు హాజరు అయ్యారు.</p>\n<p>నాటా అధ్యక్షులు సంజీవ రెడ్డి, జాయింట్ ట్రెజరర్ మోహన్ పట్లోల్ల, జాయింట్ సెక్రటరీ శ్రీధర్ కొరిసపాటి, సలహా మండలి డాక్టర్ పైళ్ల మల్లా రెడ్డి బోర్డు సభ్యులు: స్టాన్లీ రెడ్డి, రాజేశ్వర్ రెడ్డి, ప్రదీప్ సామల, చిన్న బాబు రెడ్డి, రాఘవ రెడ్డి ఘోశాల, హరి వేల్కుర్, ఆళ్ళ రామి రెడ్డి, రమేష్ చంద్ర, సంతోష్ రెడ్డి పాతూరి, శ్రీనివాస్ గనగోని, విష్ణు కోటంరెడ్డి, మాజీ బోర్డు సభ్యులు: మహేందర్ ముసుకు, ఫణి తాడేపల్లి, వెంకట్ వడ్డాడి, రీజినల్ వైస్ ప్రెసిడెంట్: శ్రీధర్ కుంబాల, శ్రీధర్ గూడాల, స్టాండింగ్ కమిటీ చైర్: మహేష్ బీగాల, అన్నా రెడ్డి, మొహమ్మద్ ముర్తుజా, రవి కొండబోలు , శేఖర్ కొనాల మరియు కో చైర్ నరేష్ చింతలచెరువు, రీజినల్ కోఆర్డినేటర్: శరత్ మందపాటి, శ్రీకాంత్ రెడ్డి లక్కసాగరం, అంజన్ కర్నాటి , భానోజి రెడ్డి, శరత్ వేట, విజయ్ బత్తుల, నరసింహా రెడ్డి, విజయ్ పోలంరెడ్డి హాజరు అయిన వారి లో వున్నారు.</p>\n<p>నాటా ప్రెసిడెంట్ సంజీవ రెడ్డి గారు నాటా ఆశయాలను, వచ్చే రెండు సంవత్సరాల్లో ప్రవేశ పెట్ట బోతున్న కార్యక్రమాలను వివరించారు. అలాగే డిసెంబర్ లో జరిగే నాటా సేవ డేస్ కూడా ఇంకా ఎక్కువ గ్రామాల్లో సేవలందించడానికి ముమ్మరం గా కృషి చేస్తామని చెప్పారు. హైదరాబాద్ లో టెర్రరిస్ట్ చర్యలకు భాధ్యులైన వారిని కఠినం గా శిక్షించాలని, ఇక ముందు ఇలా జరగకుండా తగు జాగ్రత్తలు తీసుకోవాలని కేంద్ర రాష్ట్ర ప్రభుత్వాలను కోరారు.</p>\n<p>మల్లా రెడ్డి గారు మాట్లాడుతూ ఈ సంవత్సరాంతానికి పది వేల సభ్యత్వం నమోదు అయేలా అందరూ కృషి చేయాలనీ పిలుపు ఇచ్చారు. స్టాన్లీ రెడ్డి గారు మాట్లాడుతూ అందరూ కలిసికట్టుగా పనిచేసి పది వేలు సభ్యులు అయ్యేలా పనిచేయాలని కోరారు. రాజేశ్వర్ రెడ్డి గారు మాట్లాడుతూ నార్త్ ఈస్ట్ లో చాలా కార్యక్రమాలు విజయవంతం గా నిర్వహించామంటే రీజినల్ కోఆర్డినేటర్ ల పాత్ర ఎంతో వుందని వారందరిని మరియు యూత్ ని ప్రోత్సహించాలని కోరారు.</p>\n<p>నాటా జాయింట్ ట్రెజరర్ మోహన్ పట్లోల్ల గారు మాట్లాడుతూ ఈ కార్యక్రమాన్ని నిర్వహించిన రాజేశ్వర్ రెడ్డి గారి ని అభినందిచారు. నాటా జాయింట్ సెక్రటరీ శ్రీధర్ కోరిసపాటి గారు మాట్లాడుతూ డాల్లస్ లో సభ్యత్వ నమోదు కార్యక్రమానికి ముమ్మరంగా కృషి చేస్తున్నారని, ఈ సంవత్సరాంతానికి 500 సభ్యులను నాటా లో చేరతారని భావిస్తున్నట్లు తెలియచేసారు.</p>\n<p>ప్రదీప్ సామల గారు మాట్లాడుతూ అట్లాంటా లో జరిగే కాన్ఫరెన్స్ స్వయం సమృద్ధి అయ్యేలా కొన్ని సూచనలు చేసారు. ఆళ్ళ రామి రెడ్డి గారు మాట్లాడుతూ అమెరికా లో ఎవరికైనా అత్యవసర సహాయం చేయడానికి నాటా ఎమర్జెన్సీ ఫండ్ ఏర్పాటు చేయవలసిన ఆవశ్యకత ను వివరించారు. ఈ ఫండ్ ఆవశ్యకతను గుర్తిస్తూ మల్లా రెడ్డి గారు, సంజీవ రెడ్డి గారు ఈ ఫండ్ ఏర్పాటు అయ్యేలా వారి పూర్తి సహకారాన్నిఅందిస్తామని తెలియచేసారు. ఇంకా ఈ సమావేశం లో బోర్డు సభ్యులు రమేష్ చంద్ర, శ్రీనివాస్ గనగోని, మాజీ బోర్డు సభ్యులు ఫణి తాడేపల్లి, వెంకట్ వడ్డాడి, రీజినల్ వైస్ ప్రెసిడెంట్: శ్రీధర్ గూడాల, స్టాండింగ్ కమిటీ చైర్: మహేష్ బీగాల,రవి కొండబోలు రీజినల్ కోఆర్డినేటర్: భానోజి రెడ్డి లు కూడా ప్రసంగించారు.</p>\n<p>ఈ కార్యక్రమానికి వ్యాఖ్యాత గా శ్రీకాంత్ రెడ్డి లక్కసాగరం వ్యవహరించారు. ఈ కార్యక్రమాన్ని కవర్ చేసిన మీడియా పార్టనర్స్ టీవి5 శ్రీధర్ చిల్లర గారికి, టీవి9 శ్రీనివాస్ ముత్యాల గారికి నిర్వాహకులు కృతజ్ఞతలు తెలియ చేసారు. ఈ సమావేశం శరత్ మందపాటి వందన సమర్పణ తో ముగిసింది. సభ్యులు అందరూ హ్యుస్టన్ రీజినల్ కోఆర్డినేటర్ అరుణ్ సాయం మృతి కి సంతాపం గా రెండు నిమిషములు మౌనం పాటించారు.</p>','8af83949891b95de6faff181be5f91c2.jpg','','2015-03-13 11:11:25',10,'default','0');
INSERT INTO `news` VALUES (71,'NATA Celebrates Gurajada Swarnotsavalu in Atlanta','<p>NATA Atlanta celebrated the 150th birth year of the famous Telugu poet, radical thinker and social reformer, shri Gurajada Appa Rao. The Event was held on Saturday, November 03, 2012 at the spacious Banquet hall of &ldquo;Brindavan&rdquo; Restaurant in Alpharetta, GA. More than 250 people attended and thoroughly enjoyed the entertaining literary and cultural festival that marked this joyous occasion.<br />&ldquo;Maha Kavi&rdquo;Gurjada, as he is famously known, was unique in many ways. This included his deep empathy for the under privileged , his social reforms, his strong desire to bring about social awareness through his poetry &amp; plays and his revolutionary style of employing the spoken telugu script to produce plays that stirred the conscience of the literate and illiterate alike.<br />While there were many telugu Organizations across USA that hold Gurajada in high esteem, it is a matter of pride to us that NATA Atlanta is the first organization of its kind in USA to successfully conceive and diligently execute such a cultural event in his memory and honor. The program began with the traditional &ldquo;jyoti prajwalana&rdquo;, followed by reminiscences of Gurjada and his works and the inspiration that members drew from them. Bala Indurti, Dr. Vijaya Vemulapalli, Rao Oleti, Ravi Kandimalla, Srini Vangimalla, Dr. Satyanarayana Reddy, Dilip Reddy Tunki, Goutham Goli, Raman Doddla, &amp; Ramesh Chaparala were invited to perform this traditional ceremony.<br />There was a fantastic surprise in store for the audience, when Bala Indurti informed them that the great grandson of Guarjada was one of them in Atlanta all along. This little known fact came richly into light, with the revelation from shri Oleti Rao Garu, one of Atlanta&rsquo;s literary giants and respected scholar. Rao garu shared the memorable experiences of his famous ancestor to a spellbound audience and in his gentle tone and rich language, gave a singular perspective of one of the greatest telugu literary giants of all times.<br />Melodious songs kept the audience entranced and several among the audience actively came forward and shared their respect for Gurjada. Venkat Chennubhotla, Ram Durvasula, Phani Dokka, Usha, Sneha, Lakshmi Vedala and Padma Puchha were some of the popular singers that enthralled the audience with their singing.<br />Gurajada&rsquo;s famous &ldquo;desa bhakti geyalu&rdquo;, including the literary master piece &ldquo;desamunu perminchamanna&rdquo; were sung with patriotic fervor by the group from Amrithavarshini that included many young children. Atlanta can truly take pride in not only the current wealth of literary talent, but also in the prolific group of talented youngsters who have been carefully guided by their parents and teachers to preserve our rich cultural values and pursuit of excellence.<br />&ldquo;Puthhadi Bomma Purnamma&rdquo;will remain forever in the hearts of telugu people, as one of the most touching works of art from Gurjada. Phani Dokka shared his poetic creation, inspired from this masterpiece. There was not a dry eye in the audience, as Phani combined his rich baritone and gentle splash of words to provide an enchanting view of the epic saga.<br />An event of this nature would not have been possible without the dedicated help and active support of several team members. NATA is truly proud to have so many people who treasure our culture and traditions in their midst. On behalf of NATA, Bala Indurti, Dr. Vijay Vemulapalli, &amp; Hanuman (SVK Systems) presented the awards to the team members who had been instrumental in making NATA a house hold name in the South East region.</p>\\n<p>Srini Vangimalla proposed the vote of thanks.</p>\\n<p>Design Flyer &amp; Banner &ndash; Raghava Tadavarthi<br />Photography &ndash; GV Rao<br />Video &ndash; Sridhar Vakiti<br />Food &ndash; Goutham Goli and Ramana Reddy<br />Musical entertainment &ndash; Venkat Chennubhotla and Ram Durvasula<br />Stage preparation &ndash; Sreenivas Reddy Kotluru, Kiran Reddy Kandula , Ravi Singareddy, Jagdeesh Cheemarla, Prasant Kollipara, Guru Parandhami, Satya Karnati<br />Video presentation &ndash; Ram Durvasula, Venkat Mondeddu, Goutham Goli, Ravi Kandimalla, Gireesh Meka &amp; Sridhar Vakiti.<br />MC &ndash; Hari Pothukuchi</p>\\n<p>It was a day to remember Gurjada and his contributions. It also became in turn, a day that created many fond memories for the telugu community in Atlanta.</p>','46487b5844cb1bfc520a05b825f2a5f1.jpg','','2015-03-13 11:12:07',10,'default',NULL);
INSERT INTO `news` VALUES (72,'NATA\\\'s Health Fair Benefited over 400 People','<p>New Jersey (September 19, 2011). North American Telugu Association (NATA) has successfully completed Mega Health Fair on September 17th at Royal Albert\\\'s Palace, Fords, NJ. This was one of the best mega-level Health Fair organized by the NATA NJ team, said many participants.</p>\\n<p>There are over 400 people participated and took advantage of the health screenings, and educational seminars. About 118 Medical staff (doctors, nurses, and technicians) from various organizations such as St. Peter\\\'s Health Care System, NAMI NJ, ADA NJ, Middlesex County Public Health Dept, AAIN-NJ2, NJ Stroke Coordinators Consortium and SKN Foundation participated in the health fair. About 45 booths were setup in the health fair to provide various services. This event was organized under the overall advice of Dr. Pailla Malla Reddy and by a team of highly committed NATA leader and coordinators.</p>\\n<p>This FREE event was organized by the NATA Community Services team, led by Srinivas Ganagoni (CS Chair), as part of NATA\\\'s core mission to provide community services and charitable activities. It was done with the help clinical advisors Dr. Meena Murthy, Chief of Endocrinology, Nutrition and Metabolism at St. Peter\\\'s University Hospital, Dr. Naveen Mehrotra, Dr. Chandrakala Kamath, and Varsha Singh.</p>\\n<p>NJ Assemblyman Upendra Chivukula graced the occasion as Chief Guest said that he has never seen such big health fair before and lauded the team for conducting it in a professional manner. AVN Reddy had overseen the activities of the health fair and re-affirmed that NATA is committed in doing more community services such as this event here in US and back home in India. Jay Jimenez, Vice President for Government Affairs at St. Peter\\\'s Healthcare System, attended the Health Fair and commented that this was one of the biggest health fair that he attended in the past 10 years with most services offered and very well organized by NATA. He publicly announced that St.Peter\\\'s health care system will work with NATA in future events.</p>\\n<p>The NATA team consists of Mahendra Musuku (BOD), Mohan Patalolla (BOD), Suresh Sadipiralla (BOD), Rajeshwar Reddy (EVP), Pradeep Samala (Secretary), Santosh Pathuri (Co-Chair) Sarath Veta (CS Member), Vamsi Koppuravuri (CS Member), Krishna Sidhada (CS Member), Arun Sri Ramineni (CS Member), Mahender Reddy ((RC), Sreedhar Gudala (CS Member), Srikanth Gunje (CS Member),Ravi Dhannapuneni(CS Member), Vamsi Garuda(CS Member) helped in planning and executed the event under the guidance of Dr. Malla Reddy (Advisory Council Member).</p>\\n<p>The pre-registered participants who started coming from 8.00 am and standing in line to get the health services such as blood glucose, BP, Nutrition status, BMI, Eye Screening, Oral Health Screening, Stroke, Breast cancer, Sleep, memory &amp; mood disorders, and arthritis. The educational sessions conducted in the afternoon by expert doctors. Dr. David Alcid, chief of Infectious Diseases at Saint Peter\\\'s University Hospital, spoke on \\\'Prevention of Communicable Diseases\\\'. Dr. Meena Murthy, chief of Endocrinology, Nutrition and Metabolism at Saint Peter\\\'s University Hospital, spoke on \\\'Metabolic Syndrome\\\'. Dr. Naveen Mehrotra, founder of SKN Foundation, spoke on \\\'Obesity in Children\\\'.</p>\\n<p>\\\'This health fair was very helpful to many visiting parents and uninsured people\\\' said president AVN Reddy, Mahender Musuku and Mohan Reddy, NATA Board of Directors. NATA has committed to continue such health fairs in other cities of USA, said AVN Reddy.</p>\\n<p>The following donors helped making this event possible: Dr. Pailla Malla Reddy, Thota Ravinder, Srinivas Mendu, Mohan Patalolla, Sreedhar Gudala, Sreekanth Gunje, Comprehensive Practice Management LLC, Ravi Dhannapuneni, Kavita Subramanian, Sarath Veta, Prasad and Rani Vutkuru, Shiva Reddy Meka, Roopa Nampally(Weichert Realtor) and Lalitha Gollamudi (Art of Living).</p>','223b69fb2a5caaef22c5236f8c2aebdb.JPG','','2015-03-13 14:39:46',10,'default',NULL);
