INSERT INTO `news` VALUES (85,'NATA Mourns Death of - The People\\\'s President APJ Abdul Kalam','<p>Former Indian President <em>APJ Abdul Kalam</em> died on Monday at a hospital in Meghalaya, where he had gone to deliver a lecture at the Indian Institute of Management in Shillong. He was 83.</p>\n<p><strong>Dr. Kalam</strong> reportedly collapsed on stage at the IIM and was rushed to the Bethany hospital. Doctors say he suffered from a massive cardiac arrest.</p>\n<p><strong>Dr. Kalam</strong> - The 11th President on India between 2002 and 2007 - was born in Rameswaram on October 15, 1931, to the family of a boatman. After serving a term of five years, he returned to his civilian life of education, writing, and public service. He has received several prestigious awards, including the Bharat Ratna, India\'s highest civilian honor.</p>\n<h4>HIS GREATEST QUOTES:</h4>\n<ol type=\"1\">\n<li><strong>On the Youth:</strong> My message, especially to young people is to have courage to think differently, courage to invent, to travel the unexplored path, courage to discover the impossible and to conquer the problems and succeed. These are great qualities that they must work towards.</li>\n<li><strong>On Leadership:</strong> Let me define a leader. He must have vision and passion and not be afraid of any problem. Instead, he should know how to defeat it. Most importantly, he must work with integrity.</li>\n<li><strong>On Religion:</strong> For great men, religion is a way of making friends; small people make religion a fighting tool.</li>\n<li><strong>On Corruption:</strong> If a country is to be corruption free and become a nation of beautiful minds, I strongly feel there are three key societal members who can make a difference. They are the father, the mother and the teacher.</li>\n<li><strong>On Scientific development:</strong> English is necessary as at present original works of science are in English. I believe that in two decades times original works of science will start coming out in our languages. Then we can move over like the Japanese.</li>\n<li><strong>On Hardship:</strong> Man needs his difficulties because they are necessary to enjoy success.</li>\n<li><strong>On Students:</strong> One of the very important characteristics of a students is to question. Let the students ask questions.</li>\n<li><strong>On Freedom:</strong> If we are not free, no one will respect us.</li>\n<li><strong>On Poetry:</strong> Poetry comes from the highest happiness or the deepest sorrow.</li>\n<li><strong>On Children: </strong>While children are studying to be unique, the world around them is trying by all means to make them like everybody else.</li>\n<li><strong>On Science: </strong>Science is global. Einstein\'s equation E=mc2 has to reach everywhere. Science is a beautiful gift to humanity. We should not distort it. Science does not discriminate between multiple races.</li>\n<li><strong>On Life: </strong>Life is a difficult game. You can win it only by retaining your birthright to be a person.</li>\n<li><strong>On the Death Penalty: </strong>One of the more difficult tasks for me as President was to decide on the issue of confirming capital punishment awarded by courts... to my surprise... almost all cases which were pending had a social and economic bias. This gave me an impression that we were punishing the person who was least involved in the enmity and who did not have a direct motive for committing the crime.</li>\n<li><strong>On Dreaming: </strong>Dream, Dream, Dream. Dream transforms in to thoughts. And thoughts result in action.</li>\n<li><strong>On Beauty:</strong> I\'m not a handsome guy, but I can give my hand to someone who needs help.Beauty is in the heart, not in the face.</li>\n</ol>\n<p>\"If you want to shine like a sun, first burn like a sun,\" APJ Abdul Kalam had said in one of his inspirational speeches. He certainly did.</p>\n<p>Today that sun has set.</p>\n<p><strong>Sincerely<br />NATA Team</strong></p>','03f8bc3a3f75affed03874411674dffe.jpg','','2015-07-28 21:23:53',2123,'default','0');
INSERT INTO `news` VALUES (86,'Workshop and Concert on Annamacharya Keerthanalu by Padmashree Awardee  Dr Shobha Raju','<h4>Workshop and Concert on Annamacharya Keerthanalu by Padmashree Awardee Dr Shobha Raju</h4>\n<p>Workshop 13th to 22nd July</p>\n<p>Concert on 18th July</p>\n<p>NATA (North American Telugu Association) organized a work shop (music lessons) on Annamacharya Keerthanalu beginning from 13 Keerthanalu on 18th July at Hindu Temple of Atlanta, both by Padmashree Awardee Dr Shobha Raju. Record number of students (both adults and children) have attended the workshop and learned singing of Annamacharya Keerthanalu by legendary Dr Shobha Raju. The concert was a great success with more than 250 Telugu families attending. The devotees were mesmerized by the outstanding rendering of Annamacharya Keerthanalu by Dr Shobha Raju.</p>\n<p>Dr Shobha Raju was conferred the title of &ldquo;Soul of Annamacharya&rdquo; by NATA at the concert. NATA team has announced support for Annamacharya Bhavana Vahini run by Dr Shobha Raju.</p>\n<p>The team received active support from Dr Prem Reddy (NATA Advisory Council Chairman), Dr Mohan Mallam (President), Rajeswar Reddy Gangasani(President Elect), Dr Raghava Reddy Ghosala (Executive Vice President), Bala Indurti (Past BOD and Atlanta Convention Convenor), Srini Vangimalla (BOD), Srinivas Kotlure (BOD), Ravi Kandimalla (Oversees Coordinator) and other members from NATA Advisory Council, Executive Committee and Board of Directors. The event was organized by NATA leaders Venkat Mondeddu (RVP), Kiran Kandula (RVP), Nanda Gopinatha Reddy (RVP), Archana Reddy (Volunteer), Bindu Jonnalagadda (RC), Ramesh Kotike (RC), Ramky Chodavarapu (RC), Kishore Mellacheruvu (RC), Guru Paradarami (National Committee Co-chair and RC). The event would not have been possible without the initiative and extraordinary help from Archana Reddy who was instrumental in organizing these events last year in Atlanta. We received active help from National Standing Committee Chairs Madhavi Indurti, Neelima Gaddamanugu, Jagadeesh Cheemarla and Ramesh Chaparala. NATA appreciates help from Srinivas Durgam (Sound system) and Kishore Tatikonda (Photography and Video).</p>\n<p>NATA also thanks Srinivas Kukkadapu and Hema Shipla for their help for these NATA appreciates the sponsors Deccan Abroad, Serenity Infotech, Everest Technologies, Krishna Training, Medha Academy, Arvy Tech, GTAM (Gallega Technology and Management Institute), Softpath System and DJ Durgam&rsquo;s. We also thank Ravi Chander of Soft Path System LLC for his generous donation to Annamacharya Bhavana Vahini. We appreciate leadership of Hindu Temple of Atlanta and Mahalakshmi Temple for helping us with venues. We thank TV5, TV9, YuppTV, CVR News, Great Andhra, Saakshi, Andhra Jyothi, Eenadu for their Media coverage.</p>','837c2ee28c1484677d0078d1fd4a194d.jpg','','2015-08-03 20:54:02',2123,'default','0');
