INSERT INTO `news` VALUES (91,'NATA Washington DC Metro team has organized a membership drive on October 3rd, 2015 at Banjara Indian Restaurant in Ashburn,VA.','<h4>North American Telugu Association (NATA) Washington DC Metro team has organized a membership drive on October 3rd, 2015 at Banjara Indian Restaurant in Ashburn,VA.</h4>\n<p>NATA DC Metro Membership organized by Board of Directors Babu Rao Samala, Sreenivasulu Reddy Somavarapu, RVP\'s Suresh Reddy kothinti, Sudharani Kondapu, Kiran Gunnam, Chair Mohan Kaladi, Co-Chair Sireesha Thatakula, Regional coordinators Srinath Palle, Satya, Jeevan, Anil, Suresh, Ninad, Sharath, Suren and Yashaswi Bodduluri with the support of President Dr.Mohan Mallam, President-Elect Rajeshwar Gangasani Reddy and Executive Vice President Dr. Raghava Reddy Gosala.</p>\n<p>The main event started with BoD Sreenivasulu Reddy Somavarapu welcoming around 250 members amid rousing claps of NATA family members. In just 2 weeks\' time NATA DC team able to made over 230 new memberships which is an historical Record.</p>\n<p>Two upcoming singers Kiran and Manasa Acharya who came all the way from India, They have entertained the crowd with latest hit songs.</p>\n<p>President-Elect Rajeshwar Reddy graced the occasion along with Executive President Dr.Raghava Reddy Gosala, BoD Treasurer Hari Velukur, Board of Director Anna Reddy, NJ RVP Dwarka Varanasi and DC Metro Team.</p>\n<p>President-Elect Rajeshwar Reddy has explained the activities that NATA been doing in USA including Cricket tournaments, Health Camps and community services back in India. He was so proud to see how NATA helping community when it needs and matters most. He was so thrilled to see so many new members and active supporters for NATA in this region.</p>\n<p>Executive president Dr. Raghava Reddy Gosala, in his welcoming speech praised the team\'s hard-work, dedication and delivery in short time. He enthralled to see the dream of young and enthusiastic members right in front of him. Dr. Reddy reiterated NATA is there for every Telugu family and thanked each individual for attending today\'s occasion.</p>\n<p>Web Committee Chair Mohan Kaladi mentioned that the DC Metro team is able to make historical number effortlessly just because of the NATA founders and the organization name in the community.</p>\n<p>Meeting ended with Vote of Thanks from Sreenivasulu Reddy Somavarapu who thanked all the BODs/RVPs/SCs/RCs/Chairs from DC Area for making it a phenomenal event. Thanks to our Grand Sponsor Dr. Prem Reddy Garu for supporting this event. NATA Washington DC &amp; Virginia team, expressed heart full gratitude and thanked all the members and volunteers who helped this event made grand success.</p>\n<p><a title=\"Nata Photos Sudha rani\" href=\"https://photos.google.com/share/AF1QipOW1gOxgbVBOkbmz3cso2K_J9v7Zh32hlqk5pVHONKSEqh-1oeS2C6xGbwTp-Blag?key=cGg2VDFYUWdSWEVJVGs5d3ZueEJ1ZG1JNlFuT3FB\" target=\"_blank\">Nata Photos Sudha rani</a></p>\n<p><a title=\"NATA Special Drive | NATA Membership Registration in Washington DC | NTV\" href=\"https://youtu.be/9PK6rPT6Knk\" target=\"_blank\">NATA Special Drive | NATA Membership Registration in Washington DC | NTV</a></p>\n<p><a title=\"NATA membership drive a grand success in Virginia - USA - TV9\" href=\"https://youtu.be/wiiNe1ZO6WA\" target=\"_blank\">NATA membership drive a grand success in Virginia - USA - TV9</a></p>\n<p><a title=\"Telugu NRIs Attends NATA Meet &amp; Greet Event | Virginia | TV5 News\" href=\"https://youtu.be/8SIwG7x3SyY?list=PLCjN3OcTA4gjRDNL8C--aUSSSfpbylRvo\" target=\"_blank\">Telugu NRIs Attends NATA Meet &amp; Greet Event | Virginia | TV5 News</a></p>','bf6cbdea5a891ac656a318b7742a5a84.png','','2015-10-14 03:45:12',2123,'default','0');
INSERT INTO `news` VALUES (92,'Chicago Picnic','<p>North America Telugu Association (NATA)&rsquo;s, Illinois chapter organized a family picnic. The picnic brought Chicago area&rsquo;s Telugu community together with more than 200 people in attendance. Elders and seniors, who are visiting US also, came to attend. Many of Chicago&rsquo;s Telugu Community leaders graced the occasion. The day&rsquo;s nice and sunny weather greeted the families; everybody enjoyed the relaxed atmosphere with great food.</p>\n<p>NATA volunteers did an excellent job in organizing the event with tasty food cooked onsite. Delicious delicacies that included all special Non-Veg curries, Veggies snacks, Ragi Sankati, and Mirchi Pakodas.</p>\n<p>The event was a great success because of the hard work and contributions of the following NATA RVP members Venkata Reddy Lingareddy, Regional Coordiantor Srinivasa Reddy Bommineni, Krishna Poladi, Bala Kesavamatham, and Srinivasa Reddy Bommineni. Special Thanks to Shri Rajeshwar Reddy Gangasani, Raghava Reddy Ghosala, Srinivasa Reddy Kommidi and NATA leadership for their valuable guidance to make this event a grand success.</p>\n<p>Over all, it was a great event that exceeded every ones expectations. All the participants had great time and were very pleased with the event. In the end, Venkata Reddy thanked friends and Balaji groceries Naperville for the support to the event and also Thanked local leaders ATA Convener- in-charge Hanmanth Reddy and Hindu Temple of Greater Chicago trustee , Jayadev Mettupalli,</p>\n<p><a title=\"Link to Gallery\" href=\"https://drive.google.com/folderview?id=0B2Zzqtb15ZkyUzVIbWZUY0E2Q0E&amp;usp=sharing\" target=\"_blank\">Link to Gallery</a></p>\n<p><a href=\"http://www.greatandhra.com/articles/special-articles/nata-chicago-october-2015-weekend-family-picnic-69754.html\" target=\"_blank\">http://www.greatandhra.com/articles/special-articles/nata-chicago-october-2015-weekend-family-picnic-69754.html</a></p>\n<p><a href=\"http://www.idlebrain.com/nricommunity/weekendpicnic-natachicago.html\" target=\"_blank\">http://www.idlebrain.com/nricommunity/weekendpicnic-natachicago.html</a></p>\n<p><a href=\"http://cinemirchi.com/News/View/Illinois-chapter-organized-a-family-picnic-on-Sunday-1961.html\" target=\"_blank\">http://cinemirchi.com/News/View/Illinois-chapter-organized-a-family-picnic-on-Sunday-1961.html</a></p>','93f9baefe5e56a4f8b62b93df903633f.jpg','','2015-11-24 03:04:59',2123,'default','0');
INSERT INTO `news` VALUES (101,'FREE DENTAL CAMP ','<p><strong>NATA</strong> is conducting a <strong>Free Dental Camp</strong> in association with <strong>Plainsboro Recreation Center</strong> on <strong>Sunday, Nov 1st. 2015</strong><strong>​ from noon to 5.00 pm</strong>.</p>\n<p>Please see the below flyer for more information. Requesting you to share this news with your organization members, friends, families &nbsp;and help us in spreading a word. Encourage all to utilize these free services.&nbsp;</p>\n<p>​We will appreciate your help and support. Thank you.</p>\n<p>With best,</p>\n<p>Anjan Karnati</p>\n<p>NATA &ndash; Community Services &ndash; Chair</p>\n<p><a href=\"tel:609%20235%205010\">609 235 5010</a></p>','353879620eacde77bf2c5aef17e241ea.jpg','','2015-11-24 03:04:30',2123,'default','0');
INSERT INTO `news` VALUES (102,'Board Meeting at Dallas','<p><strong>Texas:</strong> North American Telugu Association (NATA) had a Board meeting in Dallas, Texas recently to discuss upcoming Dallas Convention 2016, NATA Sevadays and other important things. All the convention committees were formed and committee chairs, co-chairs and members showed enthusiasm to work for the convention. Board has thanked each and every one of them for coming forward to volunteer their time and service for NATA.</p>\n<p>President Dr. Mohan Mallam has explained various activities planned for NATA Sevadays including Solar Lights, Safe drinking water plants, Student scholarships, toilets and computers at schools and encouraged everyone to participate in this. Some Board of Directors recently showed intention to step down due to personal and family obligations. Board thanked the outgoing BODs for their valuable services and has chosen Prasuna Reddy Dornadula, Mohan Kaladi, Kiran Gunnam, Pradeep Samala, Ravi Kandimalla and Narayana Reddy Gandra to replace them.</p>\n<p>New Directors are Anna Reddy, Babu Rao Samala, Girish Ramireddy, Hari Velkur, Kiran Gunnam, Mallik Banda, Mohan Kaladi, Mohan Mallam, Mohan Reddy Talamati, Narayana Reddy Gandra, Pradeep Samala, Prasuna Reddy Dornadula, Raghava Reddy Ghosala, Rajeshwar Reddy Gangasani, Rami Alla Reddy, Rami Reddy Buchipudi, Ravi Kandimalla, Samba Reddy, Shiva Meka, Sreenivasula Reddy Kotlure, Sreenivasulu Reddy Somavarapu, Srikanth Reddy Penumada, Srini Reddy Vangimalla, Srinivas Ganagoni, Srinivasa Reddy Alla, Venkataramana Reddy Murari, Venkatarami Reddy Sanivarapu, Vishnu Kotimreddy.</p>\n<p>Advisory Council has also met as some of its members showed interest to step down to pave the way for new generation. AC has chosen Dr. Stanley Reddy, Jithender Reddy and Adisesha Reddy Bellam to replace them. Board thanked the outgoing Advisory Council members for their valuable support and service.</p>\n<table class=\"table table-bordered\">\n<thead>\n<tr>\n<td colspan=\"5\">\n<h4 class=\"text-center\">Advisory Council</h4>\n</td>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td><img src=\"../../img/advisoryCouncil/premsagar.jpg\" alt=\"\" width=\"150\" height=\"165\" /></td>\n<td><img src=\"../../img/advisoryCouncil/avnreddy.jpg\" alt=\"\" width=\"150\" height=\"165\" /></td>\n<td><img src=\"../../img/bod/StanleyReddy.jpg\" alt=\"\" width=\"150\" height=\"165\" /></td>\n<td><img src=\"../../img/bod/Jithender.jpg\" alt=\"\" width=\"150\" height=\"165\" /></td>\n<td><img src=\"../../img/sc_2015/Help_Line_Adisesha_Reddy_Bellam_2.jpg\" alt=\"\" width=\"150\" height=\"165\" /></td>\n</tr>\n<tr>\n<td>Dr. Prem Reddy (Chair)</td>\n<td>AVN Reddy</td>\n<td>Stanley Reddy</td>\n<td>Jithender Reddy</td>\n<td>Adisesha Reddy</td>\n</tr>\n</tbody>\n</table>\n<p>President-Elect Rajeshwar Reddy Gangasani took the oath from the new Board of Directors Kiran Gunnam, Mohan Kaladi, Pradeep Samala, Prasuna Reddy Dornadula, Ravi Kandimalla and Babu Rao Samala.</p>\n<p><img src=\"../../uploads/slider9.jpg\" alt=\"\" /></p>\n<p>Board also has chosen Mallik Banda as Jt. Treasurer, Nagesh Mukkamalla as Sports Committee Chair, Saroja Sagaram as Women\'s Forum Chair, Women\'s Forum Co-Chair Deep Jangari, Satwik Reddy as Youth Activities Committee Co-Chair and Youth Women Co-Chair Punneetha Reddy. Next board meeting will be in Los Angeles, California in March, 2016.</p>','6556d8257832e437db594558c50ab4e1.jpg','','2015-11-24 03:04:17',2123,'default','0');
INSERT INTO `news` VALUES (103,'NATA Seva Days & Scholarships for Students in India','<p>Dear NATA Family members,</p>\n<p>NATA Seva Days team is planning many events as part of NATA 2015 Seva Days in India in various places like Cuddapah District, Chittoor District, Tirupathi, Nellore District, Guntur District, Warangal, Nalgonda District and other places &nbsp;from December 18th to December 27th 2015 with grand finale of events in Tirupathi on Dec 19th and &nbsp;Hyderabad on Sunday, December 27th, 2015.</p>\n<p>We request all NATA Family members if possible to plan their trip to India to include the above time period and attend various NATA Seva Days events and make them a big success.</p>\n<p>Details about the schedule of events and locations&nbsp; will be shared in due time.</p>\n<p>Please contact any of the below if you need more information or wish to help&nbsp;sponsor or organize any events.</p>\n<p>Also please let us know if you are making plans to be at NATA Seva Days events in December 2015.</p>\n<p>Thanks</p>\n<p>Girish Ramireddy</p>\n<p>Secretary, NATA</p>','e48f310b8be86a205b170dbcd445d22a.jpg','','2015-11-03 20:06:09',2123,'default','0');
INSERT INTO `news` VALUES (104,'NATA Raised $600K in Dallas Fund Raising Day','<p>North America Telugu Association (NATA) raised a whopping $600,000 for the 2016 Dallas convention to be held during Memorial Day weekend (<span class=\"aBn\" tabindex=\"0\" data-term=\"goog_231599047\"><span class=\"aQJ\">May 27- 29, 2016</span></span>), at the kick-off and fund-raising event held at the SLPS center in Irving on Friday, October 09, 2015. NATA 2016 Convener, Dr. Ramana Reddy, attributed this unprecedented success to the Telugu community of Dallas. He also expressed his gratitude to the local Telugu associations TANTEX, TPAD, DATA, and DARA, and national associations TANA, ATA and NATS, for extending their complete support to the Dallas NATA team in achieving this spectacular accomplishment.</p>\n<p>The biennial NATA convention is expected to welcome over 15,000 people of Telugu origin to the Dallas convention center in downtown Dallas during Memorial Day weekend <span class=\"aBn\" tabindex=\"0\" data-term=\"goog_231599048\"><span class=\"aQJ\">May 27th - 29th</span></span>. The convention will be transmitted live on many leading TV channels to millions across the US, Canada, and India. Great philanthropist and Advisory council chair Dr. Prem Reddy, President Dr. Mohan Mallam and President Elect Rajeshwar Gangasani Reddy are working tirelessly in guiding the team for the preparations.</p>\n<div>&nbsp;</div>\n<div>The event started with a traditional prayer by Cultural team and followed by welcome note by Darga Nagireddy, Regional Vice president. The meeting started with opening remarks by Dr. Ramana Reddy Guduru, Convener for the convention. Ramasurya Reddy, Coordinator for the convention welcomed the members and thanked them for being part of the event.</div>\n<div>&nbsp;</div>\n<div>NATA president Dr. Mohan Mallam explained about various Services / Vision / Achievements, and Seva Days activities planned in India this December. The Seva days had included building water treatment plants and libraries, conducting health camps and eye camps and providing scholarships to meritorious students across Andhra Pradesh and Telangana.</div>\n<div>&nbsp;</div>\n<div>Dr. Tara Reddy along with Jayachandra Reddy EC member welcomed Advisory council chair Dr. Prem Reddy onto the stage. Dr. Prem Reddy outlined objectives of NATA as an organization. He felt extremely joyous with the team and how NATA as a whole is dedicating its selfless services to the Telugu community. He also articulated that NATA was built to serve the Telugu community in North America and in the motherland.</div>\n<div>&nbsp;</div>\n<div>Dr. Ramana Reddy Convener along with Ramasurya Reddy Coordinator introduced Dallas convention team Dr. Sridhar Reddy Korsapati Co-convener, Suresh Manduva Co-coordinator Phalgun Reddy Deputy Convener and Geetha Damanna Deputy Coordinator.</div>\n<div>&nbsp;</div>\n<div>Lakkireddy Hanimi Reddy and TANA pledged $25,000 for the 2016 Convention. Hospitality team lead by Mallikarjun Reddy Murari pledged $50,000. Other pledges are TPAD $20,000, Jayachandra Reddy $15,000, Dr. S. Raghava Reddy $10,116, and Dr. Mohan Mallam $10,001. Several donors pledged $10,000, $5000, $2500 and $1000.</div>\n<div>&nbsp;</div>\n<div>Dallas Convention Coordinator Ramasurya Reddy introduced Advisory Council, EC, BoD\'s and National Convention Committee (NCC), Advisory Council members AVN Reddy, Executive-Vice President Dr. Raghava Reddy Ghosala, Treasures Hari Velkur, Joint-Treasure Srinivas Ganagoni, NCC advisor&nbsp;&nbsp; Pradeep Samala, Executive Director Rami Reddy Alla, Dr. Stanley Reddy, Dr. Rami Reddy Buchipudi, Dr. Sinivasa Reddy Alla, Venkatramana Reddy Murari, Venkarami Reddy Sanivarapu, Srini Vangimalla, Babu Rao Samala, Chinna Babu Reddy.</div>\n<div>&nbsp;</div>\n<div>NATA Secretary Grish Rami Reddy thanked all the National leaders Dr. Adishesha Reddy, Chandra shaker Reddy, Dr. Chandra Reddy,&nbsp; &nbsp;Kiran Gunnam, Srikanth Reddy, Mohan Kaladi, Prasuna Reddy, Ravi Kandimalla, Dwarka Varanasi, Kiran Kanduala, Venka Mondadu, Local NATA &nbsp;Dallas Team, and many others attending the event.</div>\n<div>&nbsp;</div>\n<div>Dallas Convention Convener Dr Ramana Reddy, Thanked Dr. Raghava Reddy Convention Advisor for unconditional support along with&nbsp; &nbsp;all the national organization leaders such as TANA Past Presidents, Dr. Navaneeth Krishna, Prasad Thotakura, ATA Past president Dr. Sandya Gavva, and local organizations TPAD Rao Kalava, TANTAX Narasimha Reddy Urimindi, Dallas Area Telangana Association(DATA), Dallas Area Rayalaseema Association(DARA).</div>\n<div>&nbsp;</div>\n<div>Over 600 Telugu people from Dallas metro area and more than 60 leaders of&nbsp;NATA from across USA attended this event. Girish Ramireddy, Secretary &nbsp;actively engaged in overseeing the fund raising proceedings. Convention cultural co-chair Suresh Pathaneni and local singers Janaki Shankar, Chakapani Kundeti, Veena Yalamanchili, Asha Keerthy, Sreeni Elaswarapu, Akhil Mulukutla, Sreya Kodela, Keerthy Chamkura, and Kalyani Tadimeti enthralled the audience with melodies and classical dance performed by Rupa Banda group and Vani Iswara group. Ms. Rajeswari Udayagiri cultural co-chair anchored the event.</div>\n<div>&nbsp;</div>\n<div>Local Convention Chairs did excellent team work notable&nbsp; Sudhakar Reddy Srirangapali, Uma Kurri, Ravi Arimanda, Sateesh Seeram, Srinadh Reddy Palavala, Jayasimha, Ramesh Gadiraju, Srinivasa Obulareddy, Nagesh Dindukurthy deserves a special mention for their yeoman efforts for the arrangements at SLPS center. Uma Mahesh Transportation chair and Krishna Mohan Reddy co-chair took care transportation for the guests. Thirumal Reddy Kumbham and Sateesh Punnam actively coordinated media efforts. Chenna Reddy Korvi and Prasad Choppa did great job in capturing all donors\' details. Ravi Kona for security arrangements. NMS Reddy, Bhaskar Gandikota, Rekha Gajulapally, Sridevi Thanepalli, Viswanadh, Madhu Mallu, Subbareddy Kondu, Veera Reddy, Venkat Reddy, Srinivasa Veerabhadra, Prabandh Topudurthy, Suresh Kaku, Satish Bhandaru, Venkat Valleti, Venu Bhagyanagar and others helped the event</div>\n<div>&nbsp;</div>\n<div>Darga Nagireddy providing vote-of-thanks thanked Dr. Prem Reddy for sponsoring dinner. He also thanked all event coordinators, Pasand restaurant for their delicious food and excellent service, which was not compromised in any form or fashion in spite of the record turnout of 600+ guests, which was much more than the anticipated 400. Media partners Desiplaza, TV6, TV5, TV9, Radiokushi, Mastitime, Great Andhra, Namaste Andhra, Sakshi, TNI Live, Telugu Times, Telugucommunitynews, and Idle Brain were recognized for their event coverage.</div>\n<div>&nbsp;</div>\n<div>The NATA culture of positive thinking and cordiality was evident in the informal and warm way the leaders greeted all of the attendees in a fun filled atmosphere with respect towards all. The cordial camaraderie and strong rapport between the various teams, the dynamic activities of these members, the positive energy that effuses from this charged atmosphere together left no doubt that NATA 2016 convention will set a new standard for conventions in the USA.</div>','3ea5faba3dca824fc1d55560d34ae446.png','','2015-11-03 20:32:45',2123,'default','0');
INSERT INTO `news` VALUES (105,'Free Dental Camp in New Jersey','<p><strong>New Jersey: North American Telugu Association (NATA) has conducted Free Dental Camp in Plainsboro, New Jersey. This event was planned and coordinated by NATA Community Services Chair Anjan Karnati under the guidance of President-Elect Rajeshwar Reddy, Executive Vice President Dr. Raghava Reddy Ghosala, Executive Director Rami Reddy Alla, Dr. Meena Murthy and Sarath Veta as&nbsp;advisers.</strong></p>\n<p><strong>Seven Dentists from various locations have volunteered for this event and did an excellent job of Dental Screening and giving preventive health&nbsp;advises&nbsp;and samples to about 210 patients. Thanks to all the dedicated Dentists Dr. Deepika Reddy, Dr. Pallavi Chelluru, Dr.Prasanthi Bobba, Dr.Sushmitha Jeeri. Dr. Hima Bindu Atmuri and Dr. Madhusudhan Reddy who have provided their valuable service, personal time for this camp. Special thanks to Dr. Hima Bindu Atmuri for offering cleaning and x-rays at her location at free of cost. Patients who took the advantage really appreciated NATA and all the dentists for serving the community.</strong></p>\n<p><strong>This event was supported by NATA Leaders and supporters Nageshwar Mukkamalla, Ramesh Anthony, Prem Kumar, Satya Pathapati, Sreedhar Kondagunta, Board of Directors Srikanth Penumada, Shiva Meka, Mohan Kaladi, Regional Vice Presidents Sarath Mandapati, Dwarak Varanasi, NATA leaders Pratap Palagiri, Srinivas Tirumandas, Manikyam Nakka, Bala Lingala, Vamsi Bommareddy, along with all other Regional Coordinators. Treasurer Hari Velkur, Joint Secretary Srinivas Ganagoni, National Convention Adviser Pradeep Samala, BOD Anna Reddy could not make it to the event but extended their support.</strong></p>\n<p><strong>Chief Guest Dr. Meena Murthy, Director of Saint Peter\'s Thyroid and Diabetes Center and Community Outreach Director for the Department of Medicine mentioned that South Asian Community has the highest number of Dental Problems and that is leading into Diabetes and other health related issues. She thanked NATA for taking the initiative and conducting free dental camps.</strong></p>\n<p><strong>NATA President-Elect Rajeshwar Gangasani Reddy thanked Plainsboro Mayor Peter Cantu, Plainsboro Recreation and Community Services Department team Leonard Celluro Jr., Director, Craig Harley, Senior Park Ranger and Dianna for their support.</strong></p>\n<p><strong>Thanks to all the youth volunteers who provided the support at reception, registration and help in directing the patients for the community service. NATA has awarded the plaques as token of appreciation to all the dentists. Volunteers received certificate of appreciation from NATA. Special Thanks to Shikha Rastogi supporting and bringing volunteers and Sathya Pathapati for taking pictures for this event.</strong></p>\n<p>&nbsp;</p>\n<p><a href=\"https://photos.google.com/share/AF1QipOmP6nxUozSOtQnI8ktyaWLYPW6h5ZGy_5oN30xAkx1_eLPYqQrBfjBhsS4XfQmoA?key=STMyb3B4TWZPQWpuMUp5SFpGeGFWWTJhMDNQOWRB\" target=\"_blank\">NATA Free Dental Camp Event Photos in New Jersey</a></p>','6cc50f0e604ebf0d00f4d8d8aebcbf23.JPG','','2015-11-24 03:03:56',2123,'default','0');
INSERT INTO `news` VALUES (108,'Next Board Meeting - March 5th, 2016 - Los Angeles, CA','<p><strong>Dear NATA Leaders,</strong></p>\n<p>We are going to have our next NATA Board meeting on<strong> March 5th, 2016 </strong>at <strong>Holiday Inn, Ontario Airport, CA.</strong> <br />Please make your travel arrangements accordingly. <br />Please reserve your flights to reach to Ontario Airport (Code: ONT).<br />Other Details will follow soon.</p>','c47bacddba815e2919778e68f7731b1d.png','','2015-11-24 03:03:41',2123,'default','0');
INSERT INTO `news` VALUES (109,'PROCESS OF GETTING STUDENT (F-1) VISA','<p>Important information in obtaining Student (F-1) Visa to study in the United States.<br /> <a href=\"http://prasadthotakura.com/services/US%20Education_English.pdf\" target=\"_blank\">For English version</a><br /> <a href=\"http://prasadthotakura.com/services/US%20Education_Telugu.pdf\" target=\"_blank\">For Telugu version</a></p>','f15c5c2bf87e04d89eddd917fed3cdfd.jpg','','2016-01-22 19:35:15',2123,'default','0');
INSERT INTO `news` VALUES (110,'వర్జీనియా లో వేడుక -నాటా వారి కానుక','<div>\n<div dir=\"ltr\">\n<div class=\"gmail_quote\"><br />Washington DC:ఉత్తర అమెరికా తెలుగు సమితి (NATA) DC వేడుకల సందర్భంగా ఇక్కడి వర్జీనియా రాష్ట్రంలోని Stone Bridge High School వేదికగా జనవరి 30న జరిపిన సంబరాలు అంబరాన్ని తాకాయి.&nbsp; &nbsp; సుమారుగా రెండువేలమంది ప్రవాస భారతీయులు పాల్గొన్న ఈ సంబరాలు ఆద్యంతం అద్భుత కార్యక్రమాలతో రక్తి కట్టించాయి.<br /><br />జ్యోతి ప్రజ్వలనతో ప్రారంభమైన ఈ వేడుకలకు ముఖ్య అతిధులుగా నాటా అధ్యక్షులు శ్రీ మోహన్ మల్లం గారు నాటా ఉపాధ్యక్షులు శ్రీ రాఘవరేడ్డిగారు,కోశాధికారి శ్రీ హరి వేల్కురు గారు పాల్గొన్నారు.శ్రీ మోహన్ గారు ఉపన్యసిస్తూ&nbsp; మన సంస్కృతి సాంప్రదాయాలనే పునాదులుగా చేసుకొని ఉధ్భవించిన&nbsp; నాటా, మత ప్రాంత వర్గ విచక్షణలకు అతీతంగా నిలిచి&nbsp; ప్రజల చేత తెలుగు ప్రజల కోసం ఆవిర్భవించిన సంస్థగా సెలవిచ్చారు.&nbsp; తెలుగుదనాన్నే&nbsp; వేదికగా చేసుకొని&nbsp; మన చరితలోని చైతన్యాన్ని తీసుకొని, నవతరంగాల ఊపుతో ఎప్పుడూ భవితవైపు సాగే భారతీయతను నిలపడమే నాటా లక్ష్యమని పేర్కొన్నారు.అంతేగాక నాటా సంస్థయొక్క ప్రాధమిక లక్ష్యమైన &ldquo;సాంస్కృతిక వికాసమే నాటా మాట,సమాజ సేవయే నాటా బాట&rdquo; అన్న స్ఫూర్తితో నడిచే నాటా సభ్యులనందరినీ ప్రశంసించారు. పిదప రాఘవరెడ్డిగారు ప్రసంగిస్తూ మన తెలుగు రాష్ట్రాలలోని వివిధ ప్రాంతాలలో నాటా వారు నిర్వహించిన వివిధ సేవాకార్యక్రమాలను సబికులందరికీ తెలియజేస్తూ ఇంతటి అద్వితీయమైన కార్యక్రమాన్ని తీర్చిదిద్దడంలో నాటా DC Team శ్రమించిన తీరును ఆ శ్రమ వెనుక దాగున్న వారి అంకిత భావాన్ని ,వారి అంకిత భావానికి పరోక్షంగా కారకులైన వారి వారి కుటుంబ సభ్యుల&nbsp; అద్వితీయ&nbsp; ప్రోత్సాహాన్ని కొనియాడారు.&nbsp;<br />ఈ వేడుకలలో భాగంగా నిర్వహించిన పలు ఆసక్తికర పోటీలలో విధ్యార్థులు,మహిళలు అధిక సంఖ్యలో పాల్గొన్నారు.చెస్,రంగోళి,పాటల పోటీలు,Dubsmash మరియు సాంస్కృతిక కళలలో పొటీలు నిర్వహించి విజేతలకు జ్ఞాపికలను ప్రదానం చేశారు.Paradise Indian Cuisine, Gwynn Oak , Maryland వారు అందించిన పసందైన పంచభక్ష పరమన్నాలు అద్భుతమంటూ ఆరగించిన&nbsp; అతిధులందరూ అభివర్ణించారు .భావి అధ్యక్షులు&nbsp; శ్రీ రాజేశ్వర్ గంగసాని గారు,ప్రదీప్ సమల గారు ,ప్రధాన సలహాదారులు శ్రీ స్టాన్లి రెడ్డిగారు ముందు రోజు జరిగిన నాటా ప్రారంభ వేడుకలకు శ్రీకారం చుట్టారు.<br /><br />సాంస్కృతిక సాహిత్య రంగాలని మేళవించి పాశ్చ్యాత్య సంగీతపు హోరును శృతిమించనీయక విన్నూత తరహా వినోదాన్ని&nbsp; అందించడంలో నాటా చేసిన కృషి జగద్విదితం. తరాలు మారినా తెలుగు సంస్థల తలరాతలు మారవు అన్న నానుడిని పాతేసి&nbsp; తెలుగువారికి ,సాంస్కృతిక కళల అభిరుచిలో,సాహిత్యాభిరుచిలో ఓ రూపునిచ్చి ,వినోదాత్మక కార్యక్రమాలలో విశేషకృషిసల్పి సరికొత్త దిగంతాన్ని చూపించింది నాటా సంస్థ .ఈ వేడుకలకు విచ్చేసిన ప్రఖ్యాత గాయనీ గాయకులు సుమంగళి గారు,Super Singer ధనుంజయ్ గారు పాడిన గీతాలకు పసివారు సైతం చిందులు వేస్తూ సందడి చేశారు.Tollywood&nbsp; హీరోయిన్లు తేజస్విని మరియు రిచా పనాయ్ చేసిన నృత్యాలు సభికులను అలరించాయి.పిదప Dance Master రఘు&nbsp; నృత్యాలకు ప్రేక్షకుల హర్షధ్వానాలతో,ఈలలతో సభా ప్రాంగణమంతా హోరెత్తింది.లయబద్దంగా ఆడే తన పాద కదలికలు విజ్ఞులనే కాదు.. రసజ్ఞులను సైతం ఆశ్చర్యంలో ముంచెత్తాయి అనడం అతిశయోక్తి కాదేమో?<br /><br />నాటా దర్శకుల దక్షతకు కార్యకర్తల దీక్షకు దర్పణం మన ఈ సంబరం.ఇంతటి అపురూప నాటా సృష్ఠి కర్తలైన వ్యవస్థాపకులకు,నిర్మాణంలో భాగస్వాములైన ప్రతినిధులకు ఇన్ని విజయాలకు ప్రధానకారకులైన తెలుగు ప్రజలందరికీ నాటా వారు అభినందనలు తెలియజేశారు.అన్నింటికంటే ముఖ్యంగా దిగువ స్థాయిలో కార్యవర్గాన్ని బలోపేతం చేయడంలో ప్రముఖ పాత్ర వహించిన ప్రాంతీయ నాటా DC నాయకుల పాత్ర మరువలేనిది.తమకు తాము స్వచ్చంగా తరలివచ్చి,నాటా కొరకు తమ విలువైన వ్యక్తిగత సమయాన్ని వెచ్చించి ఈ వేడుకలను విజయవంతం చేయడంలో తమ వంతు పాత్ర నిర్వర్తించిన Volunteersని ఈ సందర్భంగా అభినందించారు.<br /><br />ఈశాన్య రాష్ట్రాల తెలుగువారికి నాటావారు అందించిన అపురూపమైన కానుకగా ఈ వేడుకలను పలువురు అభివర్ణించడం కొసమెరుపు.<br /><br /><br />నమస్సుమాంజలులతో..<br />మీ నాటా..<br />సమాజ సేవయే నాటా బాట..!</div>\n</div>\n</div>','ebb40b6a8211562312eb8cf774d49e16.jpg','','2016-02-03 20:14:31',2123,'default','0');
INSERT INTO `news` VALUES (111,'NATA is gearing up for Dallas Convention','<p>NATA, the North American Telugu Association is gearing up for its Dallas Convention 2016. The event is scheduled to happen on the last weekend of May i.e. from May 27th to May 29th. The event is happening at the Kay Bailey Hutchison Convention Center Dallas.</p>\n<p>Various programs are organized for the event. There are cultural events which include Classical Dance, Short Skits, Ballets, Small Skits, Karaoke, Dubsmash and many other events. Panel Discussion on various issues by prominent celebrities is also planned.</p>\n<p>The stage is also set for a Youth Forum which has Science Workshops, Youth Night, Arts and Crafts along with various other events.</p>\n<p>The convention also has Business Seminars and Political Forum in its schedule. Apart from the above mentioned the event has got a fair share of literary events and Spiritual events on its schedule.</p>\n<p>Prominent personalities from different walks of life are invited for the Convention. Politicians like Bandaru Dattatreya, D. K Aruna, P. V. Midhun Reddy, N. UttamKumar Reddy, SA Sampath Kumar are some of the main Politicians who are attending the event.</p>\n<p>Hero Sampoornesh Babu is also expected to attend the event while actresses like Nitya Menon, Hamsa Nandini, Siya Goutham, Tejaswini, Madhuri Itagi are on the invitees list.</p>\n<p>Telugu movie directors like Harish Shankar, Kodandarami Reddi and Gandhi are likely to precede the convention.</p>\n<p>Famous Tollywood comedians like Prudhvi Balireddy, Sapthagiri, Praveen, Bittar Satti and Bithiri Savitra are expected to spread smiles at the convention.</p>\n<p>Spiritual invitees to the convention include Dr Prakasa Rao Velagapudi, Kalyan Viswanathan, Swami Sarveshananda, Swami Paratmananda, Swami Abhishek Chaitanya Giri. &nbsp;Sri K. Prabhakar Reddy IAS is also expected at the event.</p>\n<p>Ravindra Sannareddy, Sri City Managing Director and Uday Reddy, Yupp TV CEO are the prominent business personalities scheduled to attend the event.</p>\n<p>All the travel and Hotel arrangement is updated on the official website of the event. Contact information of the organizers and volunteers is also updated on the website.</p>\n<p>The schedule of each event is also updated on the website so as to make the visitors available with the programs organized. The North American Telugu Association is inviting one and all for the event.</p>','a3139bb53d16ff92772b5aa4e5696034.jpg','','2016-05-27 01:39:24',2123,'default','0');
