INSERT INTO `news` VALUES (115,'कैंसस हमले से हिले हुए हैं अमरीका में भारतीय - BBC हिंदी','<div id=\"m_4312274909538884706m_6592628186250790594yui_3_16_0_1_1490823960954_4996\" dir=\"ltr\"><a id=\"m_4312274909538884706m_6592628186250790594yui_3_16_0_1_1490823960954_4995\" class=\"m_4312274909538884706m_6592628186250790594enhancr2_3f5021df-f830-358b-5242-71bed16bc825\" href=\"http://www.bbc.com/hindi/international-39160719\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.bbc.com/hindi/international-39160719&amp;source=gmail&amp;ust=1491052726781000&amp;usg=AFQjCNFQ-Vl6RFWxLRdNrkx5Hdm799Pfkg\">कैंसस हमले से हिले हुए हैं अमरीका में भारतीय - BBC हिंदी</a></div>\n<p>&nbsp;</p>','de3d1ef2f60f1eacb26ed27da2a371f8.PNG','','2017-04-01 02:06:52',2123,'default','0');
INSERT INTO `news` VALUES (116,'NATA Meet & Greet with Dr. Vijay Chander Reddy','<p><strong>NATA Meet &amp; Greet with Dr. Vijay Chander Reddy</strong></p>\\n<p>Edison, NJ: North American Telugu Association(NATA) organized meet &amp; greet with Dr. Vijay Chander Reddy, who is a Secretary General of OASIS (Orthopedics Association of South Indian States), Convener for BJP Telangana State Political Feedback Committee and BJP State Working Committee member in NJ on March 27,2017.</p>\\n<p>The event started with American and Indian National Anthem. Dr. Reddy explained about the recent BJP victory in UP and Uttarakhand and the victory was able to achieve because of Prime Minister Shri Narender Modiji good governance and good leadership from Amith Shah ji.&nbsp;</p>\\n<p>NATA President, Rajeshwar Gangasani in his remarks mentioned that NATA will work with all political spectrum including Dr. Reddy in Telagana and Andhra during the seva days, seek every one&rsquo;s help to make the NATA seva days a grand success in India.&nbsp;</p>\\n<p>Srinivas Ganagoni, NATA-Int&rsquo;l Vice President, welcomed the audience and presided the meeting and requested Dr. Vijay Chander to help NATA during seva days to help set up the health camps and serve the needy in Telangana.&nbsp;</p>\\n<p>Krishna Reddy,President-PFBJP, Sreekanth Penumada, Scretary-NATA, Anna Reddy, Joint Secretary- NATA gave their remarks and requested Dr. Reddy to communicate NRI issues back to Indian Government and thanked his services towards the community.&nbsp;</p>\\n<p>Many community leaders from NATA, ATA, TATA, Lead India Foundation, OFBJP, Kalabharathi &amp; North Jersey Telugu Association participated in the event and gave best wishes to Dr. Reddy to succeed in his future endeavors.&nbsp;</p>\\n<p>Picture Gallery:</p>\\n<p>https://drive.google.com/drive/u/1/folders/0B0YWX1wSffUWVEtWX1oxZ0FuR3M</p>','c9b6590413c9e08de538606535a50e45.PNG','','2017-04-05 02:05:59',2123,'default',NULL);
INSERT INTO `news` VALUES (118,'Meet and greet, cheer and hear Padma Shri Dr. V. Mohan on May 1st','<div class=\"\" data-block=\"true\" data-editor=\"d2ad1\" data-offset-key=\"e3ndt-0-0\">\n<div class=\"_1mf _1mj\" data-offset-key=\"e3ndt-0-0\"><span data-offset-key=\"e3ndt-0-0\"><span data-text=\"true\">All are invited to this event and meet a special guest Padma Sri Dr.Mohan on May 1, 2017</span></span></div>\n</div>\n<div class=\"\" data-block=\"true\" data-editor=\"d2ad1\" data-offset-key=\"bcct8-0-0\">\n<div class=\"_1mf _1mj\" data-offset-key=\"bcct8-0-0\"><span data-offset-key=\"bcct8-0-0\">&nbsp;</span></div>\n</div>\n<div class=\"\" data-block=\"true\" data-editor=\"d2ad1\" data-offset-key=\"8bkup-0-0\">\n<div class=\"_1mf _1mj\" data-offset-key=\"8bkup-0-0\"><span data-offset-key=\"8bkup-0-0\"><span data-text=\"true\">RSVP required - register using http://www.saintpetershcs.com/Events/May-2017/Diabetes-in-South-Asians-Dietary-Influences-and-S</span></span></div>\n</div>','897a96b07d14a160d0f68ed0cbf7eddb.PNG','','2017-04-27 15:57:17',2123,'default','0');
INSERT INTO `news` VALUES (119,'please donate NOW to fulfill the wish of a dying man','<p>Dear NATA family,<br /><br />We want to thank you for all the contributions you&rsquo;ve already made to help our community. It&rsquo;s time for us to come together again and collectively help Anil&rsquo;s final wish. Please read below:<br /><br />Anil Pallikonda is in his terminal stage fighting head and neck cancer. Doctors at Herman memorial Hospital (Houston) have concluded that he cannot be treated any further, and advised hospice to spend his final days. <strong>He&rsquo;s merely 37&hellip; with a wife and a 2-year old daughter</strong>.<br /><strong><br />His last wish is to travel back to India</strong>. Because of traumatic bleeding and his inability to fly commercial, the only way to take him back to India is through Air Ambulance which costs $93000.<br /><br />Please <a href=\\\"http://bit.ly/2q6kgVz\\\" target=\\\"_blank\\\" data-saferedirecturl=\\\"https://www.google.com/url?hl=en&amp;q=http://bit.ly/2q6kgVz&amp;source=gmail&amp;ust=1494676062769000&amp;usg=AFQjCNGiCZBt457o-uPPqYPmOdcC7TLlww\\\"><strong>click here</strong></a> to donate and help Anil&rsquo;s family and friends pay for the Air Ambulance. We are requesting that you <strong>please donate NOW to fulfill the wish of a dying man</strong>.<br /><br />After you donate, drop us a note indicating you did. Write to: <a href=\\\"mailto:rameshanthony@gmail.com\\\" target=\\\"_blank\\\">Ramesh Anthony</a>. Don\\\'t mention your name or donated amount. All we are looking for is confirmation to track our support for those who need help.<br /><br />With much gratitude,<br /><br /></p>\\n<div>\\n<div><strong>N A T A</strong></div>\\n</div>\\n<div>\\n<div><font size=\\\"1\\\" color=\\\"#990000\\\"><strong><a href=\\\"http://nataus.org/\\\" target=\\\"_blank\\\" data-saferedirecturl=\\\"https://www.google.com/url?hl=en&amp;q=http://nataus.org/&amp;source=gmail&amp;ust=1494676062769000&amp;usg=AFQjCNG5wfsoukQ_bV6r5piwVoFE2j30-Q\\\">(North American Telugu Association)</a></strong></font></div>\\n</div>','c7635977b2bee021c090e6e2b1345c15.JPG','','2017-05-13 00:34:19',2123,'default',NULL);
