INSERT INTO `news_letter` VALUES (16,'NATA-Newsletter-September-2011','<p>Namasthe: A few months ago, I had the opportunity to inform you of the formation of the NATA, and its objectives and goals. I would like to give you a brief progress report of what we have done in the last 8 months and our plans for the near future.<br /> NATA Membership Status. We would like to thank the organizers for their help in soliciting about 4000 members so far in a very short period. Everywhere we have visited, our message has been very simple &ndash; NATA is a service oriented, non-regional, non-political, non-caste based, fair and transparent organization. NATA&rsquo;s main objective is to serve fellow Telugus here and back home inIndia.<br /> NATA Activities in the last 8 months.<br />&bull; Participated and co-sponsored local association functions inHouston, Los Angles,Detroit,New York,New Jersey,Atlanta,DallasandChicago.<br />&bull; Helped theTri-ValleyUniversitystudents by providing legal assistance and advice. A special committee was formed to take care of the needs of the students. Contacted foreign minister ofIndiaduring his visit toUSAand requested the delegation to contact theUSstate department for fair treatment of these students. Delegation met Secretary of State.<br /> &bull; Our Community Services committee has been very active in helping families cope with tragic situations. It is very unfortunate to see quite a few of our members becoming victims of violent crimes and losing precious lives in traffic accidents. We are planning to set up a toll-free help line, where people can call for legal and medical advice. We are also planning to advise students coming fromIndiato take term life insurance to help in tragic situations.<br />&bull; Conducted East Region Cricket Tournament in NJ and West Region Cricket Tournament in L.A. 16 teams participated in each tournament, and hundreds of youths enjoyed watching them playIndia&rsquo;s most popular sport.</p>','11713a9740c50a59053eee3967287467.png','2015-03-13 12:42:40','1');
INSERT INTO `news_letter` VALUES (17,'TCA and NATA celebrated Ugadi in Houston','<p>Houston, April 23, 2011: Houston Telugu Cultural Association has organized Ugadhi Celeberation on a grand scale with the support of NATA (North American Telugu Association). The \\\'Sreekhara Nama\\\' Ugadhi Vedukalu, a full-day melodius cultural fiesta, was held on April 23rd at Meenakshi Temple Kalyana Mandapam, Pearland, Texas. This event was attended by over 1000 Telugu people from the Houston and nearby towns, including several hundred children who made mesmerizing performences of Indian classic dances.<br />The TCA President Sarada Akunuri and the Executive Committee members Karunakar Chowdavarapu (general secretary), Sai Rachakonda (literary secretary), Mani Sastri &amp; Hema Nalini (cultural secretories), Krishna Keerthi (webmaster) and other TCA members are instrumental for this seamless event filled with a veriety of cultural shows.<br />The NATA team comprising President AVN Reddy, Dr. Samba Reddy (Media Chair), Harinath Medi (Co-convener), Manohar Medi (Regional vice-president), and Regional coordinators Raghavender Nednur, Siva Konduri and Rajender Aparasu have attended the meeting.<br />\\\'NATA is always willing to promote and support Telugu cultural programs as well as Telugu Ugadhi vedukalu in our home towns in the US and abroad\\\', said AVN Reddy in his address. He conveyed \\\'Ugadhi greetings\\\' and emphasized that NATA is a service oriented organization that strives to support local Telugus who need assistanace.<br />In her presidential address, TCA President Sarada Akunuri has explained the rich history and mission of TCA and thanked everyone for participating in the cultural program. She thanked the NATA team for supporting this Ugadhi Vedukalu. Sai Rachakonda, TCA literary secretary, has explained about the Telugu Badi program.<br />NATA teams are preparing plans to host the first NATA convention, said co-convener Harinath Medi. In his address, Dr. Samba Reddy (Media chair) said that NATA is creating a big platform for youth interested in doing social and community service. He invited local Telugus to volunteer in various committees of the NATA Convention to be held at George Brown Convention Center in Houston, Texas, from June 29 to July 1, 2012. \\\'Let\\\'s show to the entire Telugu world about the mega Houston hospitality that we can provide with a southern twist\\\' said Samba Reddy.<br />NATA regional coordinators Raghu Nadnuri and Rajender Aparasu, and Siva Konduri have described the charitable programs and invited everyone to become members of the NATA family. Local media and business persons Prasad Kalva (Andhra Radio Mirchi), Sridhar Dadi (Radio Hungama), Ramana Reddy (NY Life Insurance), and Venkat Reddy (Dish network) are among other sponsors of this event. The meeting audience were delighted with excellent performances by renowned Kuchipudi dancers, prominent Telugu singers, and local talent, especially several hundred children who showcased their talent of Telugu culture, traditional dress and cultural proficiency.<br />The cultural events were moderated by TCA cultural secretaries, Mani Sastri and Hema Nalini, while Jayasri Bondu (treasurer) was busy with accounts section. The meeting was concluded with a delicious dinner, catered from Mayuri restaurant. Karunakar Chowdavarapu, TCA general secretary, has thanked all attendees for making this meeting a grand success despite lengthy programs, especially children who watched the event with lot of patience and interest.</p>','f77749ce28d76ffa497aeefaaa328e5f.jpg','2015-03-13 12:40:39','1');
INSERT INTO `news_letter` VALUES (18,'నాటా సేవా దినోత్సవానికి సీఎంకు ఆహ్వానం','<p>ఉత్తర అమెరికా తెలుగు సంఘం (నాటా) డిసెంబరు 29న హైదరాబాద్ లో నిర్వహించ తలపెట్టిన నాటా సేవా దినోత్సవానికి రాష్ట్ర ముఖ్య మంత్రి నల్లారి కిరణ్ కుమార్ రెడ్డిని ముఖ్య అతిథిగా ఆహ్వానించింది. నాటా పబ్లిక్ రిలేషన్స్ ఛైర్ మహేష్ బిగాల, ఇండియా కోఆర్డినేటర్ ద్వారకనాథరెడ్డి, గోపీనాథ్ వెదెరెలు సీఎం క్యాంప్ ఆఫీసులో కిరణ్ ను కలిసి రవీంద్ర భారతిలో జరిగే కార్యక్రమానికి హాజరుకావాల్సిందిగా కోరినట్లు నాటా అధ్యక్షుడు ఏవీఎన్ రెడ్డి తెలిపారు. ఆ రోజున నాటా నిర్వహించే కార్యక్రమాలతో పాటు హోస్టన్ లో వచ్చే ఏడాది జరిగే కన్వెన్షన్ గురించి ముఖ్యమంత్రికి నాటా బృందం వివరించింది. ప్రవాసాంధ్రుల కోసం ఎన్.ఆర్.ఐ సెల్ ఏర్పాటు చేయాల్సింది వారు సీఎంను కోరారు. &lsquo;&lsquo;&lsquo;&lsquo;నాటా ఆరోగ్య శిబిరాలు, నీటి ప్రాజెక్టులు, విద్యార్థుల ఉపకార వేతనాల గురించి సీఎం తెలుసుకుని సంతోషం వ్యక్తం చేశారు. ఆయన స్పందన మాకెంతో ఆనందాన్నిచ్చింది&rsquo;&rsquo; అని ఏవీఎన్ రెడ్డి పేర్కొన్నారు. కాగా.. డిసెంబరు 19న తిరుపతిలో మొదలయ్యే నాటా సేవా కార్యక్రమాలు 29న హైదరాబాద్లో ముగుస్తాయని కోఆర్డినేటర్ బాల ఇందుర్తి తెలిపారు. ఈ సందర్భంగా వివిధ జిల్లాల్లో ఆరోగ్య శిబిరాలు నిర్వహిస్తారు. నెల్లూరులో ప్రేమ్ రెడ్డి, గుంటూరులో కోటేశ్వరరావు, వరంగల్ లో డాక్టర్ సాంబరెడ్డి, నిజామాబాద్ లో మోహన్ పటాలోళ్ల శిబిరాలకు స్పాన్సర్లుగా వ్యవహరిస్తారు. దీంతో బాటు నల్గొండ జిల్లాలో నీటి ప్రాజెక్టులను ఆవిష్కరిస్తారు. వీటికి డాక్టర్ పైళ్ల మల్లారెడ్డి స్పాన్సర్. 29న హైదరాబాద్ లో నూ సేవా కార్యక్రమాలు జరుగుతాయి. తాజ్ దక్కన్ లో ఉదయం నుంచి బిజినెస్ సెమినార్లు, కవి సమ్మేళనంతో బాటు సీఎంఈ ప్రోగ్రామ్స్ నిర్వహిస్తారు. సాయంత్రం రవీంద్ర భారతిలో ఉపకార వేతనాల ప్రదానం ఘనంగా జరుగుతుంది.</p>\n<div>&nbsp;</div>\n<p>&nbsp;</p>','d08c35e2fef10a02ac10638b5b6d73d3.jpg','2015-03-13 12:54:50','1');
INSERT INTO `news_letter` VALUES (19,'నాటా కన్వెన్షన్ దిశగా వడివడిగా..','<p>ఉత్తర అమెరికా తెలుగు సంఘం (నాటా) మే నెలలో నిర్వహించబోయే కన్వెన్షన్&zwnj;ను పురస్కరించుకుని కిక్ ఆఫ్ మీటింగ్&zwnj;ను మార్చి 8న డల్లాస్&zwnj;లో నిర్వహించింది. కన్వెన్షన్ కన్వీనర్ రమణారెడ్డి మాట్లాడుతూ మే 27 నుంచి 29 వరకు నాటా డల్లాస్ కన్వెన్షన్ జరుగుతుందన్నారు. తనను కన్వీనర్&zwnj;గా ఎంపిక చేసినందుకు నాటా బోర్డుకు, అడ్వైజరీ కౌన్సిల్&zwnj;కు ఆయన ధన్యవాదాలు తెలిపారు. కన్వెన్షన్ ఏర్పాట్లపై స్థానిక నాయకులు, సంస్థలతో సంప్రదింపులు జరుపుతున్నట్లు ఆయన చెప్పారు. కన్వెన్షన్ దిశగా తనకు సహకరిస్తున్న అందరికీ ఆయన కృతజ్నతలు తెలిపారు. అందరూ కలిసి కన్వెన్షన్&zwnj;ను అద్భుతంగా నిర్వహించేందుకు ముందుకు రావాలని ఆయన పిలుపునిచ్చారు.&lt;br&gt;&nbsp;<br />కోఆర్డినేటర్ రామసూర్య రెడ్డి మాట్లాడుతూ డల్లాస్ కన్వెన్షన్ సెంటర్లో జరిగే వేడుకల కోసం ఓమిని హోటల్లో అతిథుల కోసం భారీగా గదులు బుక్ చేసినట్లు తెలిపారు. కన్వెన్షన్&zwnj;ను విజయవంతం చేసేందుకు 40 కమిటీలు ఏర్పాటు చేశామని.. 300 మంది వాలంటీర్లు ఆ దిశగా పని చేస్తున్నారని చెప్పారు. నాటా సీనియర్ లీడర్, అడ్వైజర్ డాక్టర్ ఎస్.రాఘవరెడ్డి మాట్లాడుతూ కమిటీలతో కలిసి తాను సమన్వయం చేసుకుంటూ సాగుతానన్నారు. నాటా నాయకత్వం గురించి జయచంద్రారెడ్డి వివరించారు. టాంటెక్స్ అధ్యక్షుడు నరసింహారెడ్డి ఊర్మిండి మాట్లాడుతూ నాటా కన్వెన్షన్&zwnj;కు తమ పూర్తి సహకారం ఉంటుందన్నారు. ఈ వేడుకలకు సహ ఆతిథ్యమిస్తుండటం పట్ల ఆయన హర్షం వ్యక్తం చేశారు.&lt;br&gt;నాటా అడ్వైజరీ కౌన్సిల్ ఛైర్ డాక్టర్ ప్రేమ్ రెడ్డి, నాటా బోర్డ్ ఆఫ్ డైరెక్టర్స్ డాక్టర్ శ్రీనివాసరెడ్డి ఆళ్ల, డాక్టర్ రామిరెడ్డి బూచిపూడి, ఇంటర్నేషనల్ వైస్ ప్రెసిడెంట్ జయచంద్రారెడ్డి, స్టాండింగ్ కమిటీ ఛైర్స్ ఫల్గుణ్ రెడ్డి ఉమామహేశ్వర కుర్రి, జయసింహారెడ్డి, ఆర్వీపీలు దర్గారెడ్డి, మహేందర్ కామిరెడ్డి, రీజనల్ కోఆర్డినేటర్లు సతీశ్ శ్రీరాం, మురారి రెడ్డి, రంగారెడ్డి, శ్రీనివాస ఓబుల్ రెడ్డి, రవీంద్రరెడ్డి, శ్రీనివాసరెడ్డి వీరభద్ర, నాగరాజ్ చల్లా, రమేష్ గాదిరాజు, సాయి వీరాపల్లి, రవి కోన, ఉమమహేష్ పామపల్లి, వెంకటరెడ్డిలతో పాటు నాటా నాయకులు డాక్టర్ తారాకుమార్ రెడ్డి, గుర్రం శ్రీనివాసరెడ్డి, విష్ణు బత్తుల, రావు కాల్వల, ప్రతాప్ భీమ్ రెడ్డి, రమణా రెడ్డి పుట్లూరి, మహేష్ గూడూరు, సుధాకర్ రెడ్డి, వెంకట్ తాండ్ర, రఘు గజ్జల, చంద్ర బుద్ద తదితరులు ఈ సమావేశంలో పాల్గొన్నారు. టాంటెక్స్ మాజీ ఈసీ సభ్యులు సుబ్రమణ్యం జొన్నలగడ్డ, శారద సింగిరెడ్డి కన్వెన్షన్ విషయంలో తమ సలహాలు అందజేశారు.</p>\n<div dir=\"ltr\">&nbsp;</div>','dcd7907597574e40771fe070c7dce52f.jpg','2015-03-13 12:54:18','1');
INSERT INTO `policies` VALUES (2,'Policies/By Laws','<h4>Authors of Constitution</h4>\n<ol type=\"1\">\n<li>Prem Reddy</li>\n<li>Malla Reddy Pailla</li>\n<li>AVN Reddy</li>\n<li>Mohan Mallam</li>\n<li>Jithender M. Reddy</li>\n<li>Sanjeeva T. Reddy</li>\n<li>Rajeshwar G. Reddy</li>\n<li>Ramesh C. Appareddy</li>\n<li>Raghava Reddy Ghosala</li>\n<li>Ramasurya M. Reddy</li>\n</ol>\n<h5>Article I: Name</h5>\n<p>The name and title of this organization shall be the North American Telugu Association, hereinafter \"NATA\". NATA shall be a not-for-profit organization registered under the laws of the State ofNew Jerseyand shall exist in perpetuity. The functioning of NATA shall be on a calendar year basis and its fiscal year shall end on December 31 of each year.</p>\n<h5>Article II: National Headquarters</h5>\n<p>The National Headquarters of NATA shall be the principal office of NATA, which shall be initially located in the State of New Jersey. The Board of Directors from time to time may elect to change the location of NATA\'s principal office. Administrative support personnel as approved by the Board of Directors shall staff the National Headquarters.</p>\n<h5>Article III: Objectives and Purposes</h5>\n<p>NATA shall have the following objectives and purposes:</p>\n<p><strong>Section 1:</strong> To promote exchange programs for students, scientists, and professionals of Telugu origin between the United States of America and India as well as other countries.</p>\n<p><strong>Section 2:</strong> To perpetuate, preserve, and maintain the heritage of the people of Telugu origin.</p>\n<p><strong>Section 3:</strong> To assist and promote literary, cultural, educational, religious, social, economic, health and community activities of people of Telugu origin.</p>\n<p><strong>Section 4:</strong> To invite distinguished Telugu scholars, artists, artisans, and statesmen to America for lectures, seminars, and congregations.</p>\n<p><strong>Section 5:</strong> To disburse funds in theUnited States of America and other countries for charitable, cultural, religious and educational activities directly or in cooperation with other not-for-profit organizations.</p>\n<p><strong>Section 6:</strong> To serve Telugu communities across the nation, addressing mainly the issues faced by them in the mainstream society.</p>\n<p><strong>Section 7:</strong> To organize periodic Telugu literary, educational, youth, and cultural conferences, either independently or in cooperation with the Telugu or other associations.</p>\n<p><strong>Section 8:</strong> To organize biannual conferences to promote Telugu Culture and empower the members to accomplish the objectives of the organization.</p>\n<p><strong>Section 9:</strong> Such powers as are now or may hereafter be granted by the General Not-For Profit Corporation Act of the State ofNew Jersey.</p>\n<h5>Article IV: Members</h5>\n<p><strong>Section 1:</strong> NATA shall have five (5) categories of members that shall constitute the general body. The designation of such category and the qualification of the members of such category shall be as follows:</p>\n<ol type=\"A\">\n<li><strong>DIAMOND MEMBER:</strong> Any person who qualifies under section 2 of this Article IV and pays the prescribed membership dues shall be designated as a DIAMOND Member.</li>\n<li><strong>PLATINUM MEMBER:</strong> Any person who qualifies under section 2 of this Article IV and pays the prescribed membership dues shall be designated as a PLATINUM Member.</li>\n<li><strong>GOLD MEMBER:</strong> Any person who qualifies under section 2 of this Article IV and pays the prescribed membership dues shall be designated as a GOLD Member.</li>\n<li><strong>SILVER MEMBER:</strong> Any person who qualifies under section 2 of this Article IV and pays the prescribed membership dues shall be designated as a SILVER Member.</li>\n<li><strong>LIFE MEMBER:</strong> Any person who qualifies under section 2 of this Article IV and pays the prescribed membership dues shall be designated as a LIFE Member.</li>\n</ol>\n<h5>Section 2: Membership Definition</h5>\n<ol type=\"A\">\n<li><strong>Diamond Member:</strong> In order to qualify as a Diamond Member, a person must meet the qualifications of Section 3, Article IV.</li>\n<li><strong>Platinum Member:</strong> In order to qualify as a Platinum Member, a person must meet the qualifications of Section 3, Article IV.</li>\n<li><strong>Gold Member:</strong> In order to qualify as a Gold Member, a person must meet the qualifications of Section 3, Article IV.</li>\n<li><strong>Silver Member:</strong> In order to qualify as a Silver Member, a person must meet the qualifications of Section 3, Article IV.</li>\n<li><strong>Life Member:</strong> In order to qualify as a Life Member, a person must</li>\n</ol>\n<h5>For More Information Please Download</h5>\n<p><a href=\"../public/documents/NATACONSTITUTION.pdf\" target=\"_blank\">NATA CONSTITUTION</a></p>\n<p><a href=\"../public/documents/NATA BYLAWS_Final_May_2015.pdf\" target=\"_blank\">NATA BYLAWS</a></p>\n<p><a href=\"../public/documents/NATA Rules_Regulations_Final.pdf\" target=\"_blank\">NATA RULES_REGULATIONS</a></p>','','2016-10-24 07:56:12','');
INSERT INTO `president_msg` VALUES (2,'President\'s Message','<p>As the NATA President for 2016-2018 term, I would like to thank all the NATA Advisory Council, BODs, RVPs, Chairs, members and all other designated office bearers both past and present for giving me a chance to serve our proud organization.&nbsp; Today&rsquo;s NATA in its form represents and serves all Telugu People and Indians across North America.&nbsp; NATA is built on the principles of Hard work, Dedication, Honesty, Commitment, Social Service and Promote and Preserve our Telugu Culture and Heritage for our future generation.&nbsp; I am very proud to be part NATA founding team member and dedicated NATA solider.</p>\n<p>It was first time in the history of any American Indian cultural organization to achieve the strength of 13,000+ members and exceed set goals and expectations in serving our community. I would like bring everybody&rsquo;s attention to two important upcoming events: the NATA Seva days in Telugu states on December, 2017 and Mega Telugu convention in 2018. I am requesting that we all need to collaborate and cooperate with each other in a cohesive way to make these two events a grand success. During previous NATA&rsquo;s Seva days, we have helped many people to become health conscious by conducted healthcare awareness programs in both Telugu states actively.&nbsp; NATA has written a new chapter by conducting a successful Folk Artist exhibition in Warangal that a created Save the Girl Child programs. I request all the fellow members of NATA to participate and get involved actively and make our NATA planned programs during the upcoming December, 2017 a grand success in Telugu states.</p>\n<p>I would like NATA to be service oriented organization, baes on our established Motto <strong><u>&ldquo;SAMAJA SEVE NATA MATA AND SAMSKURTHI VIKASAME NATA BATA&rdquo;</u></strong>. To follow our Motto that we have adopted following guiding principles:</p>\n<ul>\n<li>NATA&rsquo;s intent is to serve and help all Telugus and Indians here and across the world without any boundaries or limitations.</li>\n<li>NATA as a cultural and Social service organization should not have any affiliation to any political party either in USA and or back in India.</li>\n<li>NATA as an organization and its activities should reflect transparency, fairness and openness without any prejudice and reservation</li>\n</ul>\n<p>&nbsp;</p>\n<p>Our NATA future plans for the next two years are as follows:</p>\n<p><strong><u>NATA USA:</u></strong></p>\n<ul>\n<li>Membership drives across the country to increase the members to 20,000 or more.</li>\n<li>Advise students coming to USA from India to take minimum $100,000 term life. insurance policy. Costs pennies but helps in a big way, when a person loses precious life in a violent crime, accident or other severe diseases. Provide counseling services for new arrivals in USA.</li>\n<li>Strengthen the Community Services: Help local communities here in USA by offering key important services provided by SAHA (ADA, AHA), Student counseling, &ldquo;Call Doctor&rdquo; Call Attorney&rdquo; type phone line services.</li>\n<li>Internships in India for students from USA, apart from what we are doing for the last 6 years.</li>\n<li>Promote Telugu culture and traditions to 2nd generation kids, who were born and raised here by arranging a youth conference and other activities, where they can meet and get to know each other and our Telugu heritage.</li>\n<li>Release of NATA MAATA Patrika (two for 2017 and two for 2018).</li>\n</ul>\n<p>&nbsp;</p>\n<p><strong><u>NATA India</u></strong></p>\n<ul>\n<li>Addition of &ldquo;NATA SEVA DAYS&rdquo; in various parts of Telengana, AP and Karnataka, India- December 2017:</li>\n<li>Continue awarding scholarships to poor merit students that includes physically handicap students</li>\n<li>Health Camps; General &amp; Pediatric Eye Camps; Water Projects; Essay &amp; Story Writing Competitions &amp; cultural Programs.</li>\n<li>Seek sponsors to provide basic facilities in villages like safe drinking water facilities, providing primary schools facilities and Swactha Barath (Toilet Program).</li>\n<li>NATA SEVA Day&rsquo;s Souvenir 2017</li>\n</ul>\n<p>&nbsp;</p>\n<p>We request you to come forward to organize charity programs and raise funds for our villages. By supporting the above-mentioned programs, we can a make big difference in life style and living standards of the people in villages across both Telugu states and in India through NATA. In order to meet the set goals of NATA Seva days, we will appoint a team soon that will address the communication needs of the Telugu and other states to disseminate updates and information.</p>\n<p>Finally, I would like to congratulate Houston convention team, Atlanta Convention team and Dallas Convention on their success during the past conventions. Under the great leader ship of NATA Advisory Council chair Dr Prem Reddy Garu, ATA, TATA have come forward to joins hands and work for the planned <strong>American United Telugu Convention &amp; Youth Conference</strong> (Mega Telugu Convention &amp; Youth Conference<strong>), July 6<sup>th</sup>-8th 2018, </strong><strong>being held in Philadelphia.&nbsp; </strong></p>\n<p>I sincerely request all the NATA leaders and members to actively participate in opening the Seva gates and travel with me for the next two years.</p>\n<p>&nbsp;</p>','eb4153f7afebd5e46c392b31e9276184.jpg','test.jpg','','2017-05-25 11:39:50');
INSERT INTO `print_coverage` VALUES (4,'NATA Health Fair Benefited over 400 People in NJ','<p>New Jersey(September 19, 2011). North American Telugu Association (NATA) has successfully completed Mega Health Fair on September 17th at Royal Albert&rsquo;s Palace, Fords, NJ. This was one of the best mega-level Health Fair organized by the NATA NJ team, said many participants.</p>\n<p>There are over 400 people participated and took advantage of the health screenings, and educational seminars. About 118 Medical staff (doctors, nurses, and technicians) from various organizations such as St. Peter&rsquo;s Health Care System, NAMI NJ, ADA NJ, Middlesex County Public Health Dept, AAIN-NJ2, NJ Stroke Coordinators Consortium and SKN Foundation participated in the health fair. About 45 booths were setup in the health fair to provide various services. This event was organized under the overall advice of Dr. Pailla Malla Reddy and by a team of highly committed NATA leader and coordinators.</p>\n<p>This FREE event was organized by the NATA Community Services team, led by Srinivas Ganagoni (CS Chair), as part of NATA&rsquo;s core mission to provide community services and charitable activities. It was done with the help clinical advisors Dr. Meena Murthy, Chief of Endocrinology, Nutrition and Metabolism at St. Peter&rsquo;s University Hospital, Dr. Naveen Mehrotra, Dr. Chandrakala Kamath, and Varsha Singh.</p>\n<p>NJ Assemblyman Upendra Chivukula graced the occasion as Chief Guest said that he has never seen such big health fair before and lauded the team for conducting it in a professional manner. AVN Reddy had overseen the activities of the health fair and re-affirmed that NATA is committed in doing more community services such as this event here in US and back home in India. Jay Jimenez, Vice President for Government Affairs at St. Peter&rsquo;s Healthcare System, attended the Health Fair and commented that this was one of the biggest health fair that he attended in the past 10 years with most services offered and very well organized by NATA. He publicly announced that St.Peter&rsquo;s health care system will work with NATA in future events.</p>\n<p>The NATA team consists of Mahendra Musuku (BOD), Mohan Patalolla (BOD), Suresh Sadipiralla (BOD), Rajeshwar Reddy (EVP), Pradeep Samala (Secretary), Santosh Pathuri (Co-Chair) Sarath Veta (CS Member), Vamsi Koppuravuri (CS Member), Krishna Sidhada (CS Member), Arun Sri Ramineni (CS Member), Mahender Reddy ((RC), Sreedhar Gudala (CS Member), Srikanth Gunje (CS Member),Ravi Dhannapuneni(CS Member), Vamsi Garuda(CS Member) helped in planning and executed the event under the guidance of Dr. Malla Reddy (Advisory Council Member).</p>\n<p>The pre-registered participants who started coming from 8.00 am and standing in line to get the health services such as blood glucose, BP, Nutrition status, BMI, Eye Screening, Oral Health Screening, Stroke, Breast cancer, Sleep, memory &amp; mood disorders, and arthritis. The educational sessions conducted in the afternoon by expert doctors. Dr. David Alcid, chief of Infectious Diseases at Saint Peter&rsquo;s University Hospital, spoke on &lsquo;Prevention of Communicable Diseases&rsquo;. Dr. Meena Murthy, chief of Endocrinology, Nutrition and Metabolism at Saint Peter&rsquo;s University Hospital, spoke on &lsquo;Metabolic Syndrome&rsquo;. Dr. Naveen Mehrotra, founder of SKN Foundation, spoke on &lsquo;Obesity in Children&rsquo;.</p>\n<p>&lsquo;This health fair was very helpful to many visiting parents and uninsured people&rsquo; said president AVN Reddy, Mahender Musuku and Mohan Reddy, NATA Board of Directors. NATA has committed to continue such health fairs in other cities of USA, said AVN Reddy.</p>\n<p>The following donors helped making this event possible: Dr. Pailla Malla Reddy, Thota Ravinder, Srinivas Mendu, Mohan Patalolla, Sreedhar Gudala, Sreekanth Gunje, Comprehensive Practice Management LLC, Ravi Dhannapuneni, Kavita Subramanian, Sarath Veta, Prasad and Rani Vutkuru, Shiva Reddy Meka, Roopa Nampally(Weichert Realtor) and Lalitha Gollamudi (Art of Living).</p>\n<p>For event pictures, visit:</p>','4a1c282f8a309e8370a68dc7ed3a40c5.jpg','2015-03-12 16:05:45','1');
INSERT INTO `print_coverage` VALUES (5,'BAPS Honored Prof. Samba Reddy at Houston Health Fair - See more at: http://www.greatandhra.com/articles/special-articles/82038203baps-honored-prof-samba-reddy-at-houston-health-fair-55981.html#sthash','<p>Houston: Prof. Samba Reddy was among those honored at the BAPS 14th Annual Health Fair held on April 26, 2014 in the Houston Swaminarayan Mandir, the biggest Hindu Temple in America. Prof. Reddy was honored for his exceptional professional accomplishments and community services, both of which continue to inspire Indian-Americans of all age groups. &nbsp; BAPS Charities, the public service wing of BAPS that has built hundreds of the world&rsquo;s largest Mandirs, is a champion of community service that has touched millions of needy people worldwide. &lt;br&gt;They have been conducting annual health fairs in the Houston area since 2000 which, to date, have benefited over 33,500 individuals through the volunteer services of over 2000 physicians, 2500 allied healthcare professionals, and countless volunteers. BAPS&rsquo;s massive scale and their efforts to positively impact the local community have been widely recognized, drawing attention from many big names. Prof. Reddy was a guest of honor at the BAPS 14th Annual Health fair in Houston along with notable dignitaries such as Dr. Stephen Brotherton, Texas Medical Association President and Hon. Robert Hebert, Fort Bend County Judge.&lt;br&gt; Through two decades of research, Prof. Reddy, a professor of medicine at Texas A&amp;M University, has made exceptional contributions to medicine by inventing new treatments for epilepsy, which affects 60 million worldwide. Additionally, Prof. Reddy has a commendable community service record, especially in providing education, healthcare, and guidance to undeserved populations. He helped conduct over 20 eye camps, vaccination drives, and health fairs of his own in India and the United States. Furthermore, as Community Chair of NATA, he has been answering emergency calls for tragedies and deaths involving Telugus and Indians in the U.S., providing services such as funeral arrangements. His NATA team has raised an emergency fund for this task. The 14th Annual BAPS Health Fair has benefited over 2500 people, providing various medical services and inspiring health consciousness among the population.&lt;br&gt; &ldquo;In terms of scale of operation, this is the best health fair I ever attended. It was meticulously organized and perfectly executed with a dedicated team of volunteers, doctors and organizers,&rdquo; said Prof. Reddy. &ldquo;I am grateful to BAPS for this profound honor and the opportunity to witness the fair. I have learned a great deal from them about community service. I admire BAPS for promoting the spirit of seva (selfless service)-giving back to the community which has given so much to us.&rdquo;&nbsp;</p>','f66aa066e2e87efcada2ce5f6777fda7.jpg','2015-03-13 13:00:09','1');
