INSERT INTO `projects` VALUES (8,'NATA SEVA days Update','nsd-290x160.png','<p>Dear friends,</p>\n<p>NATA SEVA days Update:</p>\n<p>Chief Guest &ndash; CM of AP Sri. Kiran Kumar Reddy: Deputy CM &ndash; Sri. Damodar Rajanarasimha:<br />Guest of Honor &ndash; padmavibhushan Dr. ANR:Guest of Honor &ndash; padmabhushan Dr. C. Narayana<br />Reddy.</p>\n<p>NOTE: We are getting overwhelming email responses from several NATA members. You have<br />great intention to help us at the same time too many emails are confusing the NATA family. If<br />you have any question, please send email to natasevaday@nataus.org<br />Scholarships to 118 students &ndash; Health Camps in 4 districts &ndash; Water projects in 23 villages in<br />Nalgonda district.</p>\n<p>Considering the short timeframe we need coordination and support from every NATA member<br />to make the NATA SEVA days most memorable. Those who have pledged and did not get a<br />chance to pay, please call Ramasurya Reddy garu, NATA treasurer @ 201-709-5346 and take<br />care of the pledge money. Without your contribution in this matter, we cannot fulfill our NATA<br />SEVA Days commitments.</p>\n<p>Mailing address: 5106 Heritage Oaks Dr; Colleyville, TX 76034<br />We received donations from the following philanthropic donors including Dr. Prem Reddy, Dr.<br />Pailla Malla Reddy, Dr. Mohan Mallam, Dharma Reddy Gummadi, AVN Reddy, Dr. Sanjeeva<br />Reddy, T. Ramachandra Reddy, Dr. Chitten Raju, Madhu Kolan, Surya Bezawada, Jyothi Anil,<br />Sreedhar Gudala, Sharath Nasani, Sreekanth Gunge, Bhoomaiah Macherla, Mohana Vamshi<br />Chetlapally, Baswa Kumar Ampani, Ravi Kumar Bangari, Sujana Reddy, Santosh Pathuri,<br />Srinivas Ganagoni, Rajeshwar Nagireddy, Venkat Vaddadi. If your name is not here please help us at your earliest convenient time.</p>','26 Thu Feb,2015');
INSERT INTO `projects` VALUES (9,'NATA SEVA DAY – Scholraships to 117 students on Dec 29th','scalor1-290x160.png','<p>We finally received students marks list from Board of Intermediate Education (BIE) due to persistent efforts of NATA Overseas Coordinator Mr. Gopinath Reddy &amp; Dr.Dwarakanath Reddy. We highly appreciate and thank these gentlemen for their diligence in this regard. <br /> BIE is able to provide only the college names of prospective students but not the addresses so we are planning to request the respective College principal&rsquo;s to inform the students regarding NATA scholarships. Upon receiving NATA Letter students will come and receive scholarship on Dec 29th @ Ravindra Bharathi during our NATA Seva finale. Gopi garu mailing letters to college principals is the last step for this scholarship process. Each student will receive Rs 10,000.00 (Ten Thousand) and Certificate. Hon&rsquo; Chief Minister of A.P. Kiran Kumar Reddy garu is the Chief Guest for the NATA SEVA Day celebrations. <br /> Scholarship Criteria: <br /> &middot; Students should be from Govt Junior colleges of AP. &middot; Top 5 students selected from each District. &middot; One topper from each group (MPC, BPC, MEC, CEC &amp; HEC) so that scholarship money is awarded to all branches equally. <br /> Some highlights of this year scholarships: <br /> &middot; Total number of scholarships NATA will be awarding is 117.<br /> &middot; We are trying to award 5 from each district but there is a tie on 2 students in West Godavari and Praksham districts. After discussing with AVN Reddy garu we have decided to award the scholarships to 2 additional students to bring the scholarship count to 117.<br /> &middot; 58 students are girls and 57 students are boys out of 117 students.<br /> &middot; Kunapareddy Vamsi Krishna, Vijayawada (Krishna DT), received the highest marks 975/1000.</p>','13 Fri Mar,2015');
INSERT INTO `projects` VALUES (10,'Fluorine Free Potable Drinking Water','as-290x160.png','<p>The following attachments gives you information on how Fluorine Free Potable Drinking Water projects can be executed and a presentation on problems with Flurosis. Below is the summary of how a generous donor can help to sponsor a water project to provide safe drinking water for poor people in villages.</p>\n<p>&nbsp;</p>\n<p>Rotary pays 45% of the water treatment part of the project. Rotary picked up the projects where villages already have a well, pump house and land to put treatment plant. Cost of a treatment plant is about $3000, out of which Rotary pays $1250. In Nalgonda district, Rotary already identified about 50 villages with infrastructure support in place, sponsor pays $1750 and the balance is paid by Rotary and also Rotary will completely execute the project. In other places where infrastructure not in place or where there is no local support the cost of the project will go up to $4500. For these projects Rotary&rsquo;s contribution remain at $1250 and the sponsor cost would go to about $3250+.</p>\n<p>&nbsp;</p>\n<p>We request you to pick a project from Rotary selected areas and help to build a water plant for a low cost of $1750 to provide safe drinking water for 5000 poor people. Sponsors can dedicate the project to any one of their choice. It is a good humanitarian project, saves thousand of lives and saves thousands from chronic diseases.</p>\n<p>&nbsp;</p>\n<div class=\"\\&quot;clear\\&quot;\">&nbsp;</div>','13 Fri Mar,2015');
INSERT INTO `projects` VALUES (11,'NATA Health Fair Benefited over 400 People in NJ','d3x9012-290x160.jpg','<p>New Jersey(September 19, 2011). North American Telugu Association (NATA) has successfully completed Mega Health Fair on September 17th at Royal Albert&rsquo;s Palace, Fords, NJ. This was one of the best mega-level Health Fair organized by the NATA NJ team, said many participants.</p>\n<p>There are over 400 people participated and took advantage of the health screenings, and educational seminars. About 118 Medical staff (doctors, nurses, and technicians) from various organizations such as St. Peter&rsquo;s Health Care System, NAMI NJ, ADA NJ, Middlesex County Public Health Dept, AAIN-NJ2, NJ Stroke Coordinators Consortium and SKN Foundation participated in the health fair. About 45 booths were setup in the health fair to provide various services. This event was organized under the overall advice of Dr. Pailla Malla Reddy and by a team of highly committed NATA leader and coordinators.</p>\n<p>This FREE event was organized by the NATA Community Services team, led by Srinivas Ganagoni (CS Chair), as part of NATA&rsquo;s core mission to provide community services and charitable activities. It was done with the help clinical advisors Dr. Meena Murthy, Chief of Endocrinology, Nutrition and Metabolism at St. Peter&rsquo;s University Hospital, Dr. Naveen Mehrotra, Dr. Chandrakala Kamath, and Varsha Singh.</p>\n<p>NJ Assemblyman Upendra Chivukula graced the occasion as Chief Guest said that he has never seen such big health fair before and lauded the team for conducting it in a professional manner. AVN Reddy had overseen the activities of the health fair and re-affirmed that NATA is committed in doing more community services such as this event here in US and back home in India. Jay Jimenez, Vice President for Government Affairs at St. Peter&rsquo;s Healthcare System, attended the Health Fair and commented that this was one of the biggest health fair that he attended in the past 10 years with most services offered and very well organized by NATA. He publicly announced that St.Peter&rsquo;s health care system will work with NATA in future events.</p>\n<p>The NATA team consists of Mahendra Musuku (BOD), Mohan Patalolla (BOD), Suresh Sadipiralla (BOD), Rajeshwar Reddy (EVP), Pradeep Samala (Secretary), Santosh Pathuri (Co-Chair) Sarath Veta (CS Member), Vamsi Koppuravuri (CS Member), Krishna Sidhada (CS Member), Arun Sri Ramineni (CS Member), Mahender Reddy ((RC), Sreedhar Gudala (CS Member), Srikanth Gunje (CS Member),Ravi Dhannapuneni(CS Member), Vamsi Garuda(CS Member) helped in planning and executed the event under the guidance of Dr. Malla Reddy (Advisory Council Member).</p>\n<p>The pre-registered participants who started coming from 8.00 am and standing in line to get the health services such as blood glucose, BP, Nutrition status, BMI, Eye Screening, Oral Health Screening, Stroke, Breast cancer, Sleep, memory &amp; mood disorders, and arthritis. The educational sessions conducted in the afternoon by expert doctors. Dr. David Alcid, chief of Infectious Diseases at Saint Peter&rsquo;s University Hospital, spoke on &lsquo;Prevention of Communicable Diseases&rsquo;. Dr. Meena Murthy, chief of Endocrinology, Nutrition and Metabolism at Saint Peter&rsquo;s University Hospital, spoke on &lsquo;Metabolic Syndrome&rsquo;. Dr. Naveen Mehrotra, founder of SKN Foundation, spoke on &lsquo;Obesity in Children&rsquo;.</p>\n<p>&lsquo;This health fair was very helpful to many visiting parents and uninsured people&rsquo; said president AVN Reddy, Mahender Musuku and Mohan Reddy, NATA Board of Directors. NATA has committed to continue such health fairs in other cities of USA, said AVN Reddy.</p>\n<p>The following donors helped making this event possible: Dr. Pailla Malla Reddy, Thota Ravinder, Srinivas Mendu, Mohan Patalolla, Sreedhar Gudala, Sreekanth Gunje, Comprehensive Practice Management LLC, Ravi Dhannapuneni, Kavita Subramanian, Sarath Veta, Prasad and Rani Vutkuru, Shiva Reddy Meka, Roopa Nampally(Weichert Realtor) and Lalitha Gollamudi (Art of Living).</p>','13 Fri Mar,2015');
INSERT INTO `projects` VALUES (12,' Free Health Fair in NJ on NATA Roju','D3X9170-290x160.jpg','<p>New Jersey (September 01, 2011): North American Telugu Association (NATA) is conducting a NATA Roju on September 17, 2011 to reiterate NATA&rsquo;s commitment to the North American Telugu community and prepare for the convention next year to be held in Houston, Texas. A Free Health Fair and grand cultural program is being organized on September 17, 2011 at Royal Albert&rsquo;s Palace, NJ.<br /> This is a free event organized by the NATA NJ team as part of NATA&rsquo;s core mission to provide community services and charitable activities, said AVN Reddy (President) and Srinivas Ganagoni (Community Services Chair). Expert doctors will provide health counseling and advice for preventing metabolic and cardiovascular diseases, said Dr. Pailla Malla Reddy, a core advisory member and philanthropic leader of Telugu community.<br /> This will be followed by grand celebrations being held in the evening at the same venue with cultural programs showcasing Telugu talent, said Mahender Musuku (BOD) and Mohan Patalolla (BOD). Several artists from India will be performing, including popular singers and actors. The NATA team consisting of Dr. Pailla Malla Reddy (AC), Mohan Patalolla (BOD), Mahender Musuku (BOD), Rajeshwar Reddy (EVP), Mohan Reddy Talamati (BOD), Santosh Paturi (CS Co-Chair), Sarath Veta (CS Member), Ramesh Chandra (RVP) and Shiva Meka (NJ State), Vamsi Koppuravuri (CS Member), Krishna Siddada (CS Member), Arun SriRamineni(CS Member) , Damu Gedala(CS Member) and the clinical advisors (Meena Murthy, MD, Chandrakala Kamath, MD, Varsha Singh, MSN,APN-C) are spearheading efforts to make these events a wonderful community experience, said Srinivas Ganagoni (CS Chair) and Ramesh Chandra (RVP).<br /> Health Fair in NJ The Health Fair is organized from 9 A.M. to noon on September 17th and will provide free health screenings for an estimated 300 people. Clinical diagnostic tests such as blood glucose, BP, nutrition status, stroke, breast cancer, sleep, memory, and mood disorders, and arthritis will be conducted. The organizers request the people to bring their health information and medication list.<br /> The medical and health advice include &lsquo;Take Control of Your Health&rsquo;, Thyroid &amp; Hormonal Health, and Ask the Doctor or Pharmacist. Vision evaluation and dental check up are also conducted. There are opportunities to speak with the physicians for follow up meetings. Health Educational Seminars Health education is essential for prevention of infectious, metabolic and cardiovascular diseases, said Dr. Sanjeeva Reddy (MD) and Dr. Samba Reddy (RPH).<br /> As part of the NATA health fair, educational sessions will be conducted in the afternoon by expert doctors. Dr. David Alcid, chief of Infectious Diseases at Saint Peter&rsquo;s University Hospital, will speak on &lsquo;Prevention of Communicable Diseases&rsquo;. Dr. Meena Murthy, chief of Endocrinology, Nutrition and Metabolism at Saint Peter&rsquo;s University Hospital, will speak on &lsquo;Metabolic Syndrome&rsquo;. Dr. Naveen Mehrotra, founder of SKN Foundation, will speak on &lsquo;Obesity in Children&rsquo;. The uniqueness of this program is that many doctors and nurses belongs to various organizations such as Saint Peter&rsquo;s Health Care System, NAMI NJ, ADA NJ, Middlesex County Public Health Department, Dr. Jyotsna Thapar, AAIN-NJ2, the NJ Stroke Coordinator&rsquo;s Consortium, and the SKN Foundation are volunteering to serve the community on that day. <br /> Anyone interested in the health fair is encouraged to register for free using the following websitehttp://www.nataus.org/healthfair.php. Grand Cultural Programs The cultural programs to showcase Telugu talent will be held from 6 P.M. to midnight with a delicious dinner provided. As part of NATA&rsquo;s effort in the preservation and promotion of Telugu culture and heritage, the team is planning for a mega cultural program by skilled artists, dancers and singers, said Ramesh Chandra (RVP). The team is working hard to make this event a grand success.<br /> More details will be available at the NATA website. A free registration is required to attend the evening cultural programs to enable to arrange proper facilities and food arrangements. The registration can be done by logging onto http://www.nataroju.org or sending an email (natacommunityservices@gmail.com) stating the number of people attending.</p>','13 Fri Mar,2015');
INSERT INTO `projects` VALUES (13,'NATA  Community  Service  Projects  in India','nata-projects.jpg','<h4>NATA Community Service Projects in India</h4>\n<h5>Safe drinking Water Plants</h5>\n<ul>\n<li>Affordable Safe Drinking Water Plants Starting $4,000</li>\n</ul>\n<h5>Solar Standalone Street Lights</h5>\n<ul>\n<li>Street Systems Starting $230</li>\n</ul>\n<h5>Toilets for Schools</h5>\n<ul>\n<li>Starting $1000</li>\n</ul>\n<h5>Computer Systems</h5>\n<ul>\n<li>Computers &amp; Internet for Rural and Elementary Schools Starting $250</li>\n</ul>\n<h5>Scholarships</h5>\n<ul>\n<li>Financial Incentive for Merit Students - $200 per Student</li>\n</ul>','27 Mon Jul,2015');
