INSERT INTO `services` VALUES (36,'DFW- NATA Team, Kick-off Meeting','<p>&ldquo;Let&rsquo;s rejuvenate and focus our energy to initiate new programs to serve the mission of NATA&rdquo; is the theme of the evening gathered at Mayuri Indian Restaurant, Irving TX as a part of the new initiatives for the 2013. <br /> This meeting is hosted under the leadership of Jayachandra Reddy, Regional Vice President and a host of other newly elected leaders of NATA based in the Dallas/Fort Worth area. NATA is a 501(C)(3) non-profit cultural organization established in November 2010 to serve the Telugu community in North America. <br /> NATA celebrated its first convention in July 2012 and is involved in promoting community services, cultural and social activities, student assistance, and preservation and promotion of Telugu language and heritage in the United States and across the globe. <br /> The team reviewed opportunities to improve NATA membership and activities in several areas and came up with the following initiatives. <br /> Increase membership drive with a target of at least 250 new Life Members from the Dallas area Provide orientation and training programs about college planning to High School graduates Host debate programs for kids to instill leadership qualities in the next generation youth from the Telugu community Conduct health fairs to serve those without insurance as well as to bring the awareness of health and fitness in general to the Telugu community Conduct a variety of sports tournaments, such as, Cricket, Volleyball, Tennis, Chess as well as 5k Run to bring the Telugu Community together Establish channels of communication to serve the growing employment needs of the new comers to the United states including Optional Practical Training (OPT) Conduct business and financial seminars such as Estate/Tax planning, insurance and retirement planning Host &ldquo;Meet and Greet&rdquo; sessions to seek input from the Telugu community in order to serve them better Host a &ldquo;FREE Movie&rdquo; session for the benefit of Telugu community and bring awareness of NATA programs The team felt the need for frequent meetings and structured planning of activities in order to make a difference. <br /> The NATA team lead by Ramasurya Reddy, Secretary, Dr. Sridhar Reddy Korsapati, Joint Secretary, Jayachandra Reddy, Regional Vice President,Raman Reddy Kristapati, Foundation Committee Chair, Prasad Mallu, International Coordinator, , Rao Kalvala, Finance Committee Chair, Mahesh Adibhatla, Media Committee Chair, Ramana Putlur, Audit Committee Chair, Satish Bommineni, Regional Coordinator attended the kick-off meeting. <br /> Raman Reddy Kristapati(Foundation Committee Chair, ) thanked the NATA team, management of Mayuri Indian Restaurant and countless number of volunteers for their energy and enthusiasm to serve the growing needs of the Telugu community in the region.</p>','783072916e90abdda0e23a713b99ec26.jpg','','2015-03-13 14:56:51');
