INSERT INTO `services` VALUES (39,'NATA Seva Days December 2013','<p>In the last board meeting in New Orleans on April 20, 2013, it was decided to do the NATA Seva Days from December 16th to the 29th, 2013 across Andhra Pradesh. Mr. Mohan Reddy Talamati was appointed as NATA Seva Days coordinator. Executive committee had a telephone conference and discussed various projects to do during the NATA Seva Days. The following are some of the projects recommended by the executive committee and if anyone is planning to do other projects, please let me or Mohan Talamati or the executive committee know. <br /> General Health Fair and Pediatric Eye Camps So far Pullampet Kadapa sponsor Sanjeeva Reddy, Nellore sponsor Mohan Talamati, Chittor sponsor Ramana Reddy, Karimnagar, sponsor Santosh Reddy, Sunkisala, Nalgonda sponsor Malla Reddy. <br /> Water Purification Plants So far sponsors Anantaiahgari Palli, Kadapa, sponsor Sanjeeva Reddy, Nellore sponsor Mohan Talamati, Rayachoti Kadapa, sponsor Suresh Reddy, Keshapuram, Rayachoti,Kadapa, sponsor Mohan Kaladi, Puthanavari Palli, Kadapa, sponsor: Haranath, Policherla. <br /> Cemetary in Villages Nellore, sponsor: Mohan Talamati <br /> Scholarships for top inter students from government junior colleges We need sponsors for each district, 5 times 23 equals to 115. $200 per student. <br /> Benches for government elementary schools We need sponsors for this project. We will let you know the cost soon. <br /> Language and cultural events: final day at Hyderabad(December 29, 2013) a)NATA walking and jogging race 5K b)Kavi Sammelanam c)Kathala Poti d)Medical seminar (CME) e)Business seminar f)Cultural events in the evening at Silpa Kala Vedika or Ravindra Bharati. Mr. Mohan Patollola volunteered to help with this event. <br /> We need sponsors for the above programs. We also need to form NATA Seva Day coordination committee of ten people. Please let me or Mr. Mohan Talamati know if you are interested. We need people who are coming to India during this time to be volunteers for this. <br /> Sincerely, Sanjeeva T. Reddy, M.D.,Ph.D President North American Telugu Association</p>','465baf90cb6b73fa9db6b4ab70269b1e.jpg','','2015-03-13 14:45:20');
INSERT INTO `services` VALUES (40,'NATA Free Mega Health Fair in NJ Grand Success','<p>NATA in association with St. Peter&rsquo;s University Hospital organized a MEGA Health Fair on Saturday, September 28, 2013 from 1.00 pm to 4.00 pm at Buccleuch Park, 321 Easton Avenue, New Brunswick, NJ 08901. There is an overwhelming response to the fair, more than 700 people attended the health fair and received many services offered during the health fair that includes, FREE FLU VACCINATIONS, Blood Pressure, Blood Sugar, Eye Screening, Pain Management, HIV Awareness, Hepatitis Awareness, TB Awareness, Nutrition and Healthy Living, Foot and Ankle, Ask the Doctor, Ask the Pharmacist, Cancer Services, Ask the Dentist, Thyroid and Diabetes Center, Autism, Stroke Information, Fitness and Exercise Education, Financial Counseling, CyberKnife Robotic Surgery, and Cardio Metabolic Institute by expert Doctors and medical staff. One of the fair attendee sent to an emergency after thorough tests from the fair itself. <br /> This mega event was organized by NATA NJ team under the guidance &amp; support of Dr. Pailla Mallareddy (AC Member) who is the GRAND sponsor of the event, Dr. Sanjeeva Reddy (President), Dr. Haranath Policharla (EVP), Dr. Mohan Patalolla (Jt. Treasurer). Srinivas Ganagoi (BOD) planned and coordinated with Tabiri Chukunta(ED of Community Outreach, St. Peter&rsquo;s Hospital), Crystal Muhi(St. Peter&rsquo;s Hospital) and executed the event with the help of of Sarath Veta (RC),Vamsi Koppuravuru(RC),Arun Sriramineni(RC), Krishna Siddhada(RC), Srinivas Ranabothu(RC), Raj Potluri (member), Sandeep Reddy Tangirala(Rutgers Student), Sai Dinesh Reddy(Rutgers Student) and many other volunteers who helped making the event grand success. <br /> Dr. Sanjeeva Reddy (President) addressed the gathering with his keynote speech and provided more details about NATA and how NATA is different in providing services to the community across USA and also in AP, India. He mentioned that NATA is following the founding principles of &ldquo;Samskritika Vikasame NATA maata and Samaja Sevaye NATA Bata&rdquo; and he stressed that this event is a clear example and true replica of those principles. I see one side there are more than 70 children performing dances from various local dance schools on a professional stage with a traditional dresses to reflect our culture and on the other side we are providing the health services to the needy. We are very happy to associate with St. Peter&rsquo;s Hospital in providing these services. <br /> Dr. Haranath Policherla (EVP) was overwhelmed by the participants and said NATA is doing many activities similar to these kinds of events and he was very happy that the event went extremely well. He thanked St. Peter&rsquo;s team for their dedications towards the community. <br /> The FREE FLU Vaccinations are sponsored by Dr. Purnachander Sirikonda who also graced the occasion and monitored the whole flu vaccination program and thrilled to see such an amazing response from the community and he was very happy to be part of the program. <br /> Sarath Veta (RC) coordinated the cultural programs with the help of Raj Potluri and Vamsi Koppuravauri(RC). <br /> Many sponsors such as Ravinder Thota (JSMN International), Suresh Reddy(BOD),Santosh Pathuri(BOD),Mahesh Bigala(PR Chair), Anna Reddy(Membership Chair), Ramana Devulapalli (RVP), Siva Meka(RVP), Mohammed Murtuza(SC),Guna Yelamuri (Persis Biryani),Govardan Pobba(Deccan Spice),Ram(Thirupati Bhimas Masala), Damu Gedala(Coriander), Dr. Naveen Mehrotra(SKN Foundation), forward and supported the event. Raj (Paradise Biryani) provided the snacks for the event and also brought Dr. N. Sailaja who is a speaker in BHAKTI TV Channel to speak on Siddha Yoga. Siddha Science addresses to the core of energy imbalances, which cause diseases. This imbalance of energy generally manifests in the form of diseases like joint pains, back aches, diabetes, ulcers, low and high blood pressure, anemia, heart ailments, kidney problems, skin problems, allergies etc. on a physical level. On emotional front they take shape as negative thinking, anxiety, addictions, fears, traumas, and disorders at mental and emotional level. <br /> Senator Sam Thompson graced the occasion and thanked NATA and St. Peter;s Hospital for doing such a wonderful services to the community and he pledged his support towards the Indian American community. <br /> The NATA Leaders Rajeshwar Reddy(BOD),Pradeep Samala(BOD),Chinnababu Reddy(BOD), Mahender Musuku (ED), Naresh Chintalacheruvu(SC),Sreedhar Gudala(RVP-PA),Lingareddy(RC), Ram Mohan Chinnala (RC), Raj Kakkerla(RC), Avanish Raj(RC), Mallik Bolla, and other community leaders such as Nandu Balija, RG Krishnan, Hari Eppanapally, Prem Nandiwada, Manju Bhargava, Sudhakar Uppala, Suresh Makam,and Kanakam, Amar Reddy attended the event and gave positive feedback about the event. <br /> The event was supported by TFAS, and SAATHI. The entire event was live telecasted in www.manatv.net. At the end Srinivas Ganagoni Thanked all the media personal Sridhar Chillara(CEO, TV5 USA) and Srinivas Rao Mutyala(TV9) and Madan ( TV Asia), Ujwal Kasthala(Tori Radio), Venky Sadagopan(Radio Zindagi), AVR Sridharan(Radio Zindagi) and others who helped making the event successful.</p>','e752dde62373882c8162c8fd0deab40b.jpg','','2015-03-13 14:43:58');
INSERT INTO `services` VALUES (41,'చిన్నారి జీవితంలొ వెలుగురేఖలు','<p>చిన్నారి జీవితంలొ వెలుగురేఖలు</p>','a369d0c7a8a1050967a2a32bf5004f2b.jpg','','2015-03-13 14:42:37');
INSERT INTO `services` VALUES (43,'నాటా నడక (24-12-2015) - వరంగల్','<p>నార్త్ అమెరికన్ తెలుగు అసొసియేషనె (నాటా) ఋథవారం (24-12-2015) &lsquo;సేవ్ ద గర్ల్ చైల్డ్&rsquo; అని నినదిస్తూ హన్మకొండలొనీ వేయస్తంభాల అలయం నుంచి కళాశాల వరకూ వాక్ రన్ చేపట్టింది.</p>','feccff27c432f091501c5ae939d3d91e.png','','2016-01-09 03:02:35');
INSERT INTO `services` VALUES (44,'సానుభూతి కాదు.. మార్పు తేవాలి(24/12/2015)-వరంగల్','<p>. సాంఘీక సంక్షేమ శాఖ రెసిడెన్షియల్ సెక్రటరీ ప్రవీణ్ కుమార్</p>\n<p>. &lsquo;సేవ్ ద గర్ల్ చైల్డ్&rsquo; అని నినాదంతో వాక్ రన్</p>\n<p>. నగరంలో &lsquo;నాటా&rsquo; కార్యక్రమాలు</p>','a27ea031259f06406ad7651147f450c9.png','','2016-01-09 03:59:07');
INSERT INTO `services` VALUES (50,'భవిష్యత్తులో మరిన్ని సేవా కార్యక్రమాలు(24/12/2015)-వరంగల్','<ul>\n<li>వెల్లడించిన &lsquo;నాటా&rsquo; ప్రతి నిధులు</li>\n<li>నడకలో పాల్గొన్న హాస్య నటుడు వేణుమాధవ్</li>\n<li>జ్యోతి ప్రజ్వలన చేస్తున్న &lsquo;నాటా&rsquo; ప్రతినిధులు</li>\n</ul>','763af84c23d83e107b6b3e91a6084f04.png','','2016-01-09 04:00:53');
INSERT INTO `services` VALUES (52,'కళాకారులే నా గురువులు(24/12/2015)-వరంగల్','<p>. సినీ గేయరచయత చంద్రబోస్</p>\n<p>. కళాకారుల ప్రదర్శనలు</p>\n<p>. పాల్గొన్న నగరవాసులు, అభిమానులు</p>','305869e04068ab7803500c433b3f466f.png','','2016-01-09 04:01:57');
INSERT INTO `services` VALUES (53,'జానపద జాతర(24/12/2015)-వరంగల్','<ul>\n<li>.నాటా ఆధ్వర్యంలో అంబరాన్నంటిన సంబురాలు</li>\n<li>.జిల్లా కేంద్రంలో కళాకారుల భారీ ర్యాలీ</li>\n<li>.కిక్కిరిసిన నేరెళ్ల వేణుమాథవ్ కళా ప్రాంగణం</li>\n<li>. సదస్సులో సినీగేయ రచయత చంద్రబోస్</li>\n<li>.వైభవంగా నాటా సేవా డేస్ కార్యక్రమాలు</li>\n<li>.బాలికల రక్షణను బాధ్యతగా స్వీకరీంచాలి</li>\n</ul>','9a3ebfdbe21af1b0efb1b5113c39a2b0.png','','2016-01-09 04:07:18');
INSERT INTO `services` VALUES (54,'కళారూపాలకు ప్రాణం పోసిన నాటా (24/12/2015) - వరంగల్','<ul>\\n<li>. బాలికల రక్షణను బాధ్యతగా స్వీకరీంచాలి</li>\\n<li>. సినీ గేయరచయత చంద్రబోస్</li>\\n</ul>','160392f7399ff7fe18384c7a08bc2989.png','','2016-01-09 04:12:03');
INSERT INTO `services` VALUES (55,'నగరంలో ‘నాటా సేవా డేస్’ (24/12/2015) - వరంగల్','<p>. &lsquo;సేవ్ ద గర్ల్ చైల్డ్&rsquo; ర్యాలీలో విద్యార్థినులతో హాస్య నటుడు&nbsp;&nbsp;&nbsp; వేణుమాధవ్</p>','28f83a0b116f91d6c13dc63bafb1c8d5.png','','2016-01-11 19:02:26');
INSERT INTO `services` VALUES (56,'సాంస్కతిక సంరంభం (24/12/2015) - వరంగల్','<ul>\n<li>కళాకారులే నా గురువులు</li>\n<li>సినీగేయ రచయత చంద్రబోస్ ను సన్మానిస్తున్న నాటా ప్రతినిదులు</li>\n</ul>','85810f252f37c919b881357d228d5b1a.png','','2016-01-11 19:06:31');
INSERT INTO `services` VALUES (57,'ఆడ పిల్లలను కాపాడండి (24/12/2015) - వరంగల్','<p>.వరంగల్ లొ నాటా ఆధ్వర్యంలో ర్యాలీ,సదస్సు</p>','40bd6053ae4ec77b969e02b0fff7af0c.png','','2016-01-11 19:08:29');
INSERT INTO `services` VALUES (58,'సాంస్కతిక వారసత్వాన్ని కాపాడుకుందాం (24/12/2015) - వరంగల్','<p>.&rsquo; నాటా&rsquo; వ్యవస్ధాపక కార్యదర్శి ప్రదీప్ కుమర్ సామల</p>','de5393443ee709140f740b3b51ae0eb6.png','','2016-01-11 19:10:40');
INSERT INTO `services` VALUES (59,'మన కళలు. మన సంస్కతి (24/12/2015) - వరంగల్','<ul>\n<li>23న నగరంలో &lsquo;నాటా&rsquo; సేవా డే</li>\n<li>సేవ్ ద గర్ల్ చైల్డ్&rsquo; థీమే తో కార్యక్రమాలు</li>\n<li>జానపద కళలకు పెద్ద పీట</li>\n</ul>','385e09cf33d07308148df34e86da8427.png','','2016-01-11 19:17:30');
